(1, 23, 'user', 'sent', 'What is Chart Analysis?', '{\"model\": \"openai/gpt-oss-20b:free\"}', '2025-08-21 12:36:05', '2025-08-21 12:36:07', '2025-08-21 12:36:07'),
(2, 23, 'ai', 'sent', '**Chart Analysis**  \nChart Analysis is a platform feature that uses an imageprocessing AI to automatically read and evaluate a financial chart (price chart, candlestick, bar chart, etc.).  \nIt returns a structured report that includes:  \n\n- Symbol and timeframe  \n- Current price  \n- Key support and resistance levels  \n- Trend classification (uptrend, downtrend, consolidation)  \n- Technical indicators (RSI, MACD, etc.) with signals and analysis  \n- Suggested action (BUY, SELL, HOLD) with entry, stoploss, and takeprofit levels  \n- Confidence percentages for each component of the analysis  \n- Risk assessment and possible invalidation scenarios  \n\nThe output can be used directly in your trading plan or exported for further review.\n\n**How to use Chart Analysis**  \n\nStep one  \n- Visit the Chart Analysis page in the platform.  \n\nStep  \n Upload Image and choose a chart image (PNG, JPG, PDF, etc.).  \n\nStep three  \n- Click Analyze. The system will process the image and return a JSON report.  \n\nStep four  \n- Review the key data points (support/resistance, action, entry/stop/take, confidence).  \n\nStep five  \n- Apply the suggested trade parameters or adjust them to fit your risk profile.  \n\nStep six  \n- If you need to refine the analysis, you can reupload a higherresolution chart or adjust analysis settings (available on the page).  \n\n**End Note**  \nIf you require support from a real user admin, please submit a ticket for your issue.', '{\"model\": \"openai/gpt-oss-20b:free\", \"token_usage\": {\"total_tokens\": 87273, \"prompt_tokens\": 86533, \"completion_tokens\": 740}}', '2025-08-21 12:36:18', '2025-08-21 12:36:18', '2025-08-21 12:36:18'),
(3, 3, 'user', 'sent', 'What is Chart Analysis?', '{\"model\": \"openai/gpt-oss-20b:free\"}', '2025-09-09 10:24:37', '2025-09-09 10:24:37', '2025-09-09 10:24:37'),
(4, 3, 'ai', 'sent', '**Chart Analysis**  \nChart Analysis is a platform feature that uses imageprocessing AI to read and evaluate financial chartsprice charts, candlestick patterns, bar charts, etc. When you upload an image of a chart, the system returns a structured, actionable report that includes:  \n\n- Symbol & timeframe  \n- Current price and key support/resistance levels  \n- Trend classification (uptrend, downtrend, consolidation)  \n- Technical indicators (RSI, MACD, etc.) with signals and analysis  \n- Suggested trade action (BUY, SELL, HOLD) with entry, stoploss, and takeprofit levels  \n- Confidence percentages for each element of the analysis  \n\nYou can use Chart Analysis by navigating to the Chart Analysis page in the platform, clicking Upload Image, and then pressing Analyze. The system will process the image and return a JSON report that can be copied, reviewed, or exported for use in your trading plan.  \n\nIf you require support from a real user admin, please submit a ticket for your issue.', '{\"model\": \"openai/gpt-oss-20b:free\", \"token_usage\": {\"total_tokens\": 59523, \"prompt_tokens\": 59246, \"completion_tokens\": 277, \"prompt_tokens_details\": null}}', '2025-09-09 10:24:43', '2025-09-09 10:24:43', '2025-09-09 10:24:43'),
