(7, 3, 'ai', 'sent', '**EA Generator**\n\nThe EA (Expert Advisor) Generator is a feature that lets you create automated trading strategies in a quick, codefree way.  \n\n**What it does**\n\n1. You supply a few key parameters (symbol, timeframe, desired trade logic, risk settings, etc.).  \n2. The tool automatically builds a fullyfunctional EA script that can run on common trading platforms (e.g., MetaTrader).  \n3. The generated EA can be downloaded, reviewed, and deployed directly from the platform.  \n\n**Key features**\n\n- **Draganddrop rule builder**  no coding required.  \n- **Custom risk management**  set stoploss, takeprofit, and position size.  \n- **Strategy backtesting**  run the EA on historical data to see performance.  \n- **Export options**  save the EA as a script file or copy the source code.  \n- **Regular updates**  the tool adapts to new market conditions and data feeds.\n\n**How to use it**\n\nStep one  \n- Go to the **EA Generator** page in the platform.\n\nStep two  \n- Select the trading instrument and timeframe.\n\nStep three  \n- Choose your trade logic (e.g., trendfollowing, meanreversion).  \n- Set your risk parameters.\n\nStep four  \n- Click **Generate EA**.  \n\nStep five  \n- Review the generated script, run a backtest, and if satisfied, export and deploy.  \n\n**If you need help with the EA Generator**  \nYou can use this function directly in the EA Generator page. \n\n*If you require support from a real user admin, please submit a ticket for your issue.*', '{\"model\": \"openai/gpt-oss-20b:free\", \"token_usage\": {\"total_tokens\": 60156, \"prompt_tokens\": 59715, \"completion_tokens\": 441, \"prompt_tokens_details\": null}}', '2025-09-09 10:24:49', '2025-09-09 10:24:49', '2025-09-09 10:24:49'),
(8, 3, 'ai', 'sent', 'The EAGenerator is a tool that creates automated trading strategies (Expert Advisors) for your trading platform.\n\n**Key points**\n\n- It lets you design, backtest, and deploy a trading algorithm with a few clicks.  \n- Supports a variety of inputs: asset, time frame, risk level, and technical indicators.  \n- Generates fullyfunctional code that can run on the platforms builtin trading engine.  \n\n**How to use it**\n\n1. **Open the EAGenerator page**  \n   Navigate from the main dashboard to the EAGenerator section.\n\n2. **Choose the asset and timeframe**  \n   Select the market (e.g., EUR/USD) and the chart period (e.g., 1H, 4H).\n\n3. **Set strategy parameters**  \n    Risk tolerance (lot size, stoploss, takeprofit)  \n    Technical filters (EMA crossover, RSI, MACD, etc.)  \n    Entry/exit rules\n\n4. **Run the generator**  \n   Click Generate. The tool will produce the strategy code and a preview of its performance metrics.\n\n5. **Backtest**  \n   Use the platforms backtesting feature to confirm the strategys robustness over historical data.\n\n6. **Deploy**  \n   Once satisfied, click Deploy to launch the Expert Advisor on your live or demo account.\n\nFeel free to tweak the parameters and rerun the generator until you achieve the desired riskreward profile.\n\nIf you require support from a real user admin, please submit a ticket for your issue.', '{\"model\": \"openai/gpt-oss-20b:free\", \"token_usage\": {\"total_tokens\": 60303, \"prompt_tokens\": 59816, \"completion_tokens\": 487, \"prompt_tokens_details\": null}}', '2025-09-09 10:24:55', '2025-09-09 10:24:55', '2025-09-09 10:24:55'),
(9, 32, 'user', 'sent', 'what is chart analysis', '{\"model\": \"mistralai/mistral-small-3.2-24b-instruct:free\"}', '2025-09-12 09:28:41', '2025-09-12 09:28:41', '2025-09-12 09:28:41'),
(10, 32, 'ai', 'sent', 'Chart Analysis is a platform feature that uses image-processing AI to read and evaluate financial chartsprice charts, candlestick patterns, bar charts, etc. When you upload an image of a chart, the system returns a structured, actionable report that includes:\n\nSymbol & timeframe\n\nCurrent price and key support/resistance levels\n\nTrend classification (uptrend, downtrend, consolidation)\n\nTechnical indicators (RSI, MACD, etc.) with signals and analysis\n\nSuggested trade action (BUY, SELL, HOLD) with entry, stop-loss, and take-profit levels\n\nConfidence percentages for each element of the analysis\n\nYou can use Chart Analysis by:\nnavigating to the Chart Analysis page in the platform, clicking Upload Image, and then pressing Analyze.\nThe system will process the image and return a JSON report that can be copied, reviewed, or exported for use in your trading plan.\n\nIf you require support from a real user admin, please submit a ticket for your issue.', '{\"model\": \"mistralai/mistral-small-3.2-24b-instruct:free\", \"token_usage\": {\"total_tokens\": 81219, \"prompt_tokens\": 81007, \"completion_tokens\": 212, \"prompt_tokens_details\": null}}', '2025-09-12 09:28:49', '2025-09-12 09:28:49', '2025-09-12 09:28:49');
