(9, 4, 'EA: I want to trade using 20 EMA and 50 SMA with RSI(1...', 'ea_generation', 'openai/gpt-4o-2024-11-20', '{\"code\":\"Below is the MQL4 Expert Advisor (EA) code for the strategy you described. The EA implements the conditions for entry and exit based on the 20 EMA, 50 SMA, RSI(14), risk management, and trading session filter.\\n\\n```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert Advisor for 20 EMA, 50 SMA, and RSI(14) strategy          |\\n\\/\\/+------------------------------------------------------------------+\\n#property strict\\n\\n\\/\\/ Input parameters\\ninput double RiskPercent = 2.0;         \\/\\/ Risk per trade (%)\\ninput int SL_Pips = 50;                 \\/\\/ Stop Loss in pips\\ninput int TP_Pips = 100;                \\/\\/ Take Profit in pips\\ninput int EMA_Period = 20;              \\/\\/ EMA period\\ninput int SMA_Period = 50;              \\/\\/ SMA period\\ninput int RSI_Period = 14;              \\/\\/ RSI period\\ninput double MaxSpread = 5.0;           \\/\\/ Maximum spread allowed (in pips)\\ninput int StartHour = 12;               \\/\\/ London\\/NY overlap start hour (GMT)\\ninput int EndHour = 16;                 \\/\\/ London\\/NY overlap end hour (GMT)\\n\\n\\/\\/ Global variables\\ndouble LotSize;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on 2% risk                              |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize(double stopLossPips) {\\n   double riskAmount = AccountBalance() * RiskPercent \\/ 100.0;\\n   double lotSize = riskAmount \\/ (stopLossPips * Point * MarketInfo(Symbol(), MODE_TICKVALUE));\\n   return NormalizeDouble(lotSize, 2);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check trading session                                            |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsTradingTime() {\\n   int currentHour = TimeHour(TimeCurrent());\\n   if (currentHour >= StartHour && currentHour < EndHour) {\\n      return true;\\n   }\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check spread condition                                           |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsSpreadAllowed() {\\n   double spread = MarketInfo(Symbol(), MODE_SPREAD) \\/ Point;\\n   return (spread <= MaxSpread);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check buy condition                                              |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsBuyCondition() {\\n   double EMA = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE, 0);\\n   double SMA = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE, 0);\\n   double RSI = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE, 0);\\n\\n   return (EMA > SMA && RSI > 40);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check sell condition                                             |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsSellCondition() {\\n   double EMA = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE, 0);\\n   double SMA = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE, 0);\\n   double RSI = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE, 0);\\n\\n   return (EMA < SMA && RSI < 60);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Place trade with SL and TP                                       |\\n\\/\\/+------------------------------------------------------------------+\\nvoid PlaceTrade(bool isBuy) {\\n   double price = isBuy ? Ask : Bid;\\n   double stopLoss = isBuy ? price - SL_Pips * Point : price + SL_Pips * Point;\\n   double takeProfit = isBuy ? price + TP_Pips * Point : price - TP_Pips * Point;\\n\\n   LotSize = CalculateLotSize(SL_Pips);\\n\\n   if (isBuy) {\\n      OrderSend(Symbol(), OP_BUY, LotSize, price, 3, stopLoss, takeProfit, \\\"Buy Order\\\", 0, 0, Blue);\\n   } else {\\n      OrderSend(Symbol(), OP_SELL, LotSize, price, 3, stopLoss, takeProfit, \\\"Sell Order\\\", 0, 0, Red);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit() {\\n   Print(\\\"EA Initialized. Trading strategy started.\\\");\\n   return INIT_SUCCEEDED;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason) {\\n   Print(\\\"EA Deinitialized. Trading strategy stopped.\\\");\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick() {\\n   \\/\\/ Ensure trading session and spread conditions are met\\n   if (!IsTradingTime() || !IsSpreadAllowed()) {\\n      return;\\n   }\\n\\n   \\/\\/ Check if there\'s already a trade open\\n   for (int i = 0; i < OrdersTotal(); i++) {\\n      if (OrderSelect(i, SELECT_BY_POS, MODE_TRADES)) {\\n         if (OrderSymbol() == Symbol() && OrderType() <= OP_SELL) {\\n            return; \\/\\/ Exit if there\'s already an open trade\\n         }\\n      }\\n   }\\n\\n   \\/\\/ Check for buy condition\\n   if (IsBuyCondition()) {\\n      PlaceTrade(true);\\n   }\\n\\n   \\/\\/ Check for sell condition\\n   if (IsSellCondition()) {\\n      PlaceTrade(false);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n```\\n\\n### Explanation of the Code:\\n1. **Indicator Calculations**:\\n   - The EA calculates the 20 EMA and 50 SMA using `iMA` and the RSI(14) using `iRSI`.\\n   - Entry conditions are checked against the crossover and RSI levels (Buy: RSI > 40, Sell: RSI < 60).\\n\\n2. **Risk Management**:\\n   - Lot size is calculated dynamically based on a 2% risk per trade using `AccountBalance`, the stop-loss distance, and `MODE_TICKVALUE`.\\n\\n3. **Trading Session Filter**:\\n   - Trades are only allowed during the London\\/New York overlap (configured using `StartHour` and `EndHour`).\\n\\n4. **Spread Check**:\\n   - Ensures trades are only executed if the spread is within the specified maximum (`MaxSpread`).\\n\\n5. **Trade Execution**:\\n   - When a buy or sell condition is met, the EA places a trade with a 50-pip Stop Loss and 100-pip Take Profit.\\n\\n6. **Safety**:\\n   - The EA avoids opening multiple trades on the same symbol.\\n\\n### Notes:\\n- Ensure that the EA is attached to the correct chart and time frame.\\n- Adjust the `StartHour` and `EndHour` as needed for your broker\'s server time.\\n- Test the EA on a demo account or in the strategy tester before using it live.\",\"description\":\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\"}', '[]', '2025-07-12 20:46:45', '2025-07-12 20:46:45', '2025-07-12 20:46:45'),
