(18, 1, 'EA: I want to trade using 20 EMA and 50 SMA with RSI(1...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EMARSIEA.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpEMAPeriod = 20;\\ninput int InpSMAPeriod = 50;\\ninput int InpRSIPeriod = 14;\\ninput double InpRiskPercent = 2.0;\\ninput int InpStopLossPips = 50;\\ninput int InpTakeProfitPips = 100;\\ninput int InpMaxSpread = 5;\\ninput datetime InpLondonNYStart = D\'2023.01.01 08:00\';\\ninput datetime InpLondonNYEnd = D\'2023.01.01 17:00\';\\n\\n\\/\\/ Global variables\\nint EMAHandle, SMHandle, RSHandle;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialize indicators\\n   EMAHandle = iMA(NULL, 0, InpEMAPeriod, 0, MODE_EMA, PRICE_CLOSE);\\n   SMHandle = iMA(NULL, 0, InpSMAPeriod, 0, MODE_SMA, PRICE_CLOSE);\\n   RSHandle = iRSI(NULL, 0, InpRSIPeriod, PRICE_CLOSE);\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check trading time\\n   if(!IsTradingTime())\\n      return;\\n\\n   \\/\\/ Check spread\\n   if(Ask - Bid > InpMaxSpread * Point)\\n      return;\\n\\n   \\/\\/ Get indicator values\\n   double EMABuffer[], SMBuffer[], RSBuffer[];\\n   CopyBuffer(EMAHandle, 0, 0, 3, EMABuffer);\\n   CopyBuffer(SMHandle, 0, 0, 3, SMBuffer);\\n   CopyBuffer(RSHandle, 0, 0, 2, RSBuffer);\\n\\n   \\/\\/ Check buy condition\\n   if(EMABuffer[1] <= SMBuffer[1] && EMABuffer[0] > SMBuffer[0] && RSBuffer[0] > 40 && OrdersTotal() == 0)\\n   {\\n      double buyPrice = Ask;\\n      double lotSize = CalculateLotSize();\\n      PlaceOrder(OP_BUY, buyPrice, lotSize);\\n   }\\n\\n   \\/\\/ Check sell condition\\n   if(EMABuffer[1] >= SMBuffer[1] && EMABuffer[0] < SMBuffer[0] && RSBuffer[0] < 60 && OrdersTotal() == 0)\\n   {\\n      double sellPrice = Bid;\\n      double lotSize = CalculateLotSize();\\n      PlaceOrder(OP_SELL, sellPrice, lotSize);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check if current time is within London\\/NY overlap                |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsTradingTime()\\n{\\n   datetime currentTime = TimeCurrent();\\n   return(currentTime >= InpLondonNYStart && currentTime <= InpLondonNYEnd);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                      |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize()\\n{\\n   double balance = AccountBalance();\\n   double riskAmount = balance * InpRiskPercent \\/ 100.0;\\n   double pipValue = MarketInfo(Symbol(), MODE_TICKVALUE) \\/ MarketInfo(Symbol(), MODE_POINT);\\n   return(riskAmount \\/ (InpStopLossPips * pipValue));\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Place order with stop loss and take profit                       |\\n\\/\\/+------------------------------------------------------------------+\\nvoid PlaceOrder(ENUM_ORDER_TYPE orderType, double price, double lotSize)\\n{\\n   int ticket;\\n   if(orderType == OP_BUY)\\n   {\\n      ticket = OrderSend(Symbol(), OP_BUY, lotSize, price, 3, Bid - InpStopLossPips * Point, Ask + InpTakeProfitPips * Point, \\\"Buy Order\\\", 0, 0, clrGreen);\\n   }\\n   else if(orderType == OP_SELL)\\n   {\\n      ticket = OrderSend(Symbol(), OP_SELL, lotSize, price, 3, Ask + InpStopLossPips * Point, Bid - InpTakeProfitPips * Point, \\\"Sell Order\\\", 0, 0, clrRed);\\n   }\\n\\n   if(ticket < 0)\\n   {\\n      Print(\\\"OrderSend failed with error #\\\", GetLastError());\\n   }\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\"}', '[]', '2025-07-18 21:51:10', '2025-07-18 21:51:10', '2025-07-18 21:51:10'),
