(22, 13, 'EA: I want to trade using 20 EMA and 50 SMA with RSI(1...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EAStrategy.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpEMA_Period = 20;\\ninput int InpSMA_Period = 50;\\ninput int InpRSI_Period = 14;\\ninput double InpRisk_Percent = 2.0;\\ninput int InpSL_Pips = 50;\\ninput int InpTP_Pips = 100;\\ninput int InpMaxSpread = 5;\\ninput int InpLondon_NY_Start_Hour = 8;\\ninput int InpLondon_NY_Start_Minute = 0;\\ninput int InpLondon_NY_End_Hour = 16;\\ninput int InpLondon_NY_End_Minute = 0;\\n\\n\\/\\/ Global variables\\nint EMA_Handle, SMA_Handle, RSI_Handle;\\ndouble EMA_Buffer[], SMA_Buffer[], RSI_Buffer[];\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialize indicators\\n   EMA_Handle = iMA(NULL, 0, InpEMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   SMA_Handle = iMA(NULL, 0, InpSMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   RSI_Handle = iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE);\\n\\n   \\/\\/ Check for indicator creation\\n   if(EMA_Handle == INVALID_HANDLE || SMA_Handle == INVALID_HANDLE || RSI_Handle == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error creating indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   \\/\\/ Set indicator buffers\\n   ArraySetAsSeries(EMA_Buffer, true);\\n   ArraySetAsSeries(SMA_Buffer, true);\\n   ArraySetAsSeries(RSI_Buffer, true);\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicator handles\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check for London\\/NY overlap\\n   if(!IsLondonNYOverlap())\\n      return;\\n\\n   \\/\\/ Check for max spread\\n   if(Ask - Bid > InpMaxSpread * Point)\\n      return;\\n\\n   \\/\\/ Get indicator values\\n   CopyBuffer(EMA_Handle, 0, 0, 3, EMA_Buffer);\\n   CopyBuffer(SMA_Handle, 0, 0, 3, SMA_Buffer);\\n   CopyBuffer(RSI_Handle, 0, 0, 3, RSI_Buffer);\\n\\n   \\/\\/ Check for buy signal\\n   if(EMA_Buffer[1] <= SMA_Buffer[1] && EMA_Buffer[0] > SMA_Buffer[0] && RSI_Buffer[0] > 40)\\n   {\\n      double lotSize = CalculateLotSize();\\n      double sl = Bid - InpSL_Pips * Point;\\n      double tp = Ask + InpTP_Pips * Point;\\n\\n      OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, sl, tp, \\\"Buy Order\\\", 0, 0, clrGreen);\\n   }\\n\\n   \\/\\/ Check for sell signal\\n   if(EMA_Buffer[1] >= SMA_Buffer[1] && EMA_Buffer[0] < SMA_Buffer[0] && RSI_Buffer[0] < 60)\\n   {\\n      double lotSize = CalculateLotSize();\\n      double sl = Ask + InpSL_Pips * Point;\\n      double tp = Bid - InpTP_Pips * Point;\\n\\n      OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, sl, tp, \\\"Sell Order\\\", 0, 0, clrRed);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for London\\/NY overlap                                       |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondonNYOverlap()\\n{\\n   MqlDateTime timeStruct;\\n   TimeCurrent(timeStruct);\\n\\n   int currentHour = timeStruct.hour;\\n   int currentMinute = timeStruct.minute;\\n\\n   if(currentHour > InpLondon_NY_Start_Hour || (currentHour == InpLondon_NY_Start_Hour && currentMinute >= InpLondon_NY_Start_Minute))\\n   {\\n      if(currentHour < InpLondon_NY_End_Hour || (currentHour == InpLondon_NY_End_Hour && currentMinute <= InpLondon_NY_End_Minute))\\n      {\\n         return true;\\n      }\\n   }\\n\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                      |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize()\\n{\\n   double balance = AccountBalance();\\n   double riskAmount = balance * InpRisk_Percent \\/ 100.0;\\n   double lotSize = riskAmount \\/ (InpSL_Pips * Point * SymbolInfoDouble(Symbol(), SYMBOL_ASK));\\n\\n   return(NormalizeDouble(lotSize, _Digits));\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\"}', '[]', '2025-07-18 22:02:52', '2025-07-18 22:02:52', '2025-07-18 22:02:52'),
