urs (GMT)\\n   int hour = TimeHour(TimeCurrent());\\n   if (hour < TradingStartHour || hour >= TradingEndHour) return;\\n   \\n   \\/\\/ Check spread\\n   double spread = Ask - Bid;\\n   double spreadInPips = spread \\/ onePip;\\n   if (spreadInPips > MaxSpreadPips) return;\\n   \\n   \\/\\/ Get indicator values\\n   double ema0 = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE, 0);\\n   double ema1 = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE, 1);\\n   double sma0 = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE, 0);\\n   double sma1 = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE, 1);\\n   double rsi0 = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE, 0);\\n   \\n   \\/\\/ Check stop loss feasibility\\n   double minSL = MarketInfo(Symbol(), MODE_STOPLEVEL) * Point;\\n   double requiredSL = StopLossPips * onePip;\\n   if (requiredSL < minSL) return;\\n   \\n   \\/\\/ Calculate lot size\\n   double tickValue = MarketInfo(Symbol(), MODE_TICKVALUE);\\n   double stopLossPoints = StopLossPips * onePipInPoints;\\n   double maxLoss = AccountEquity() * RiskPercent \\/ 100.0;\\n   double lotSize = maxLoss \\/ (stopLossPoints * tickValue);\\n   lotSize = MathMin(lotSize, MarketInfo(Symbol(), MODE_MAXLOT));\\n   lotSize = MathMax(lotSize, MarketInfo(Symbol(), MODE_MINLOT));\\n   double lotStep = MarketInfo(Symbol(), MODE_LOTSTEP);\\n   lotSize = NormalizeDouble(lotSize, (lotStep == 0.01) ? 2 : ((lotStep == 0.1) ? 1 : 0));\\n   \\n   \\/\\/ Check buy conditions\\n   if (ema0 > sma0 && ema1 <= sma1 && rsi0 > RSI_BuyLevel) {\\n      double sl = Ask - stopLossPoints * Point;\\n      double tp = Ask + (TakeProfitPips * onePipInPoints) * Point;\\n      OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, sl, tp, \\\"\\\", MagicNumber, 0, Blue);\\n   }\\n   \\n   \\/\\/ Check sell conditions\\n   if (ema0 < sma0 && ema1 >= sma1 && rsi0 < RSI_SellLevel) {\\n      double sl = Bid + stopLossPoints * Point;\\n      double tp = Bid - (TakeProfitPips * onePipInPoints) * Point;\\n      OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, sl, tp, \\\"\\\", MagicNumber, 0, Red);\\n   }\\n}\\n```\",\"description\":\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread\"}', '[]', '2025-07-19 06:25:25', '2025-07-19 06:25:25', '2025-07-19 06:25:25'),
(25, 5, 'EA: \"I want to trade using 20 EMA and 50 SMA with RSI(...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```\\n```\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                                 |\\n\\/\\/|                        ExpertAdvisor.mq4                        |\\n\\/\\/|                                                                 |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int      EMA_Period = 20;\\ninput int      SMA_Period = 50;\\ninput int      RSI_Period = 14;\\ninput double   Risk_Percentage = 2.0;\\ninput int      Stop_Loss_Pips = 50;\\ninput int      Take_Profit_Pips = 100;\\ninput int      Max_Spread = 5;\\ninput datetime London_NY_Overlap_Start = D\'2023.01.01 08:00\';\\ninput datetime London_NY_Overlap_End = D\'2023.01.01 16:00\';\\n\\n\\/\\/ Global variables\\nint handleEMA, handleSMA, handleRSI;\\ndouble lotSize;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n  {\\n   \\/\\/ Create indicators\\n   handleEMA = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   handleSMA = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   handleRSI = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE);\\n\\n   if(handleEMA == INVALID_HANDLE || handleSMA == INVALID_HANDLE || handleRSI == INVALID_HANDLE)\\n     {\\n      Print(\\\"Error creating indicators\\\");\\n      return(INIT_FAILED);\\n     }\\n\\n   return(INIT_SUCCEEDED);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n  {\\n   \\/\\/ Release indicators\\n   IndicatorRelease(handleEMA);\\n   IndicatorRelease(handleSMA);\\n   IndicatorRelease(handleRSI);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n  {\\n   \\/\\/ Check if it\'s London\\/NY overlap time and spread is acceptable\\n   if(!IsLondonNYOverlap() || Ask-Bid > Max_Spread * Point)\\n     return;\\n\\n   \\/\\/ Calculate lot size based on risk percentage\\n   CalculateLotSize();\\n\\n   \\/\\/ Check for buy signal\\n   if(CheckBuySignal())\\n     {\\n      OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, Ask - Stop_Loss_Pips * Point, Ask + Take_Profit_Pips * Point, \\\"Buy Order\\\", 0, 0, clrGreen);\\n     }\\n\\n   \\/\\/ Check for sell signal\\n   if(CheckSellSignal())\\n     {\\n      OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, Bid + Stop_Loss_Pips * Point, Bid - Take_Profit_Pips * Point, \\\"Sell Order\\\", 0, 0, clrRed);\\n     }\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check if it\'s London\\/NY overlap time                              |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondonNYOverlap()\\n  {\\n   datetime currentTime = TimeCurrent();\\n   time_t todayStart = TimeCurrent() - (TimeCurrent() % 86400);\\n   datetime overlapStart = London_NY_Overlap_Start + (todayStart - London_NY_Overlap_Start) % 86400;\\n   datetime overlapEnd = London_NY_Overlap_End + (todayStart - London_NY_Overlap_End) % 86400;\\n\\n   return(currentTime >= overlapStart && currentTime <= overlapEnd);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                       |\\n\\/\\/+------------------------------------------------------------------+\\nvoid CalculateLotSize()\\n  {\\n   double balance = AccountBalance();\\n   double riskAmount = balance * Risk_Percentage \\/ 100;\\n   double pipValue = SymbolInfoDouble(Symbol(), SYMBOL_TRADE_TICK_VALUE) \\/ SymbolInfoDouble(Symbol(), SYMBOL_TRADE_TICK_SIZE);\\n   lotSize = riskAmount \\/ (Stop_Loss_Pips * pipValue);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for buy signal                                             |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckBuySignal()\\n  {\\n   double emaValue, smaValue, rsiValue;\\n\\n   \\/\\/ Get indicator values\\n   if(CopyBuffer(handleEMA, 0, 0, 3, &emaValue) < 0 ||\\n      CopyBuffer(handleSMA, 0, 0, 3, &smaValue) < 0 ||\\n      CopyBuffer(handleRSI, 0, 0, 1, &rsiValue) < 0)\\n     return(false);\\n\\n   \\/\\/ Check for EMA crossing above SMA and RSI > 40\\n   if(emaValue > smaValue && emaValue[1] <= smaValue[1] && rsiValue > 40 && PositionSelect(Symbol()) == false)\\n     return(true);\\n\\n   return(false);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for sell signal                                            |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckSellSignal()\\n  {\\n   double emaValue, smaValue, rsiValue;\\n\\n   \\/\\/ Get indicator values\\n   if(CopyBuffer(handleEMA, 0, 0, 3, &emaValue) < 0 ||\\n      CopyBuffer(handleSMA, 0, 0, 3, &smaValue) < 0 ||\\n      CopyBuffer(handleRSI, 0, 0, 1, &rsiValue) < 0)\\n     return(false);\\n\\n   \\/\\/ Check for EMA crossing below SMA and RSI < 60\\n   if(emaValue < smaValue && emaValue[1] >= smaValue[1] && rsiValue < 60 && PositionSelect(Symbol()) == false)\\n     return(true);\\n\\n   return(false);\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"\\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\"}', '[]', '2025-07-29 04:34:56', '2025-07-29 04:34:56', '2025-07-29 04:34:56'),
