(40, 17, 'EA: Help me create any random EA', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      RandomEA.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int      LotSize = 1;          \\/\\/ Lot size\\ninput int      MagicNumber = 12345;  \\/\\/ Magic number for orders\\ninput int      TakeProfit = 100;     \\/\\/ Take profit in points\\ninput int      StopLoss = 50;        \\/\\/ Stop loss in points\\n\\n\\/\\/ Global variables\\nint handle;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Create a random number generator\\n   handle = MathRand();\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release the random number generator\\n   MathSrand(handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if there are any open positions\\n   if(OrdersTotal() == 0)\\n   {\\n      \\/\\/ Generate a random number between 0 and 1\\n      double rand = MathRand()\\/32767.0;\\n\\n      \\/\\/ If the random number is less than 0.5, open a buy order\\n      if(rand < 0.5)\\n      {\\n         OpenOrder(OP_BUY);\\n      }\\n      \\/\\/ If the random number is greater than or equal to 0.5, open a sell order\\n      else\\n      {\\n         OpenOrder(OP_SELL);\\n      }\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Function to open an order                                         |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenOrder(int cmd)\\n{\\n   double price = cmd == OP_BUY ? Ask : Bid;\\n   double sl = cmd == OP_BUY ? price - StopLoss * Point : price + StopLoss * Point;\\n   double tp = cmd == OP_BUY ? price + TakeProfit * Point : price - TakeProfit * Point;\\n\\n   MqlTradeRequest request = {0};\\n   MqlTradeResult result = {0};\\n\\n   request.action = TRADE_ACTION_DEAL;\\n   request.symbol = _Symbol;\\n   request.volume = LotSize;\\n   request.type = cmd;\\n   request.price = price;\\n   request.sl = sl;\\n   request.tp = tp;\\n   request.deviation = 10;\\n   request.magic = MagicNumber;\\n\\n   OrderSend(request, result);\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"Help me create any random EA\"}', '[]', '2025-07-31 08:33:59', '2025-07-31 08:33:59', '2025-07-31 08:33:59'),
