(42, 19, 'EA: \"I want to trade using 20 EMA and 50 SMA with RSI(...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```\\n```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EAStrategy.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpEMA = 20;\\ninput int InpSMA = 50;\\ninput int InpRSI = 14;\\ninput double InpRisk = 2.0; \\/\\/ 2% risk per trade\\ninput int InpSL = 50; \\/\\/ 50 pips stop loss\\ninput int InpTP = 100; \\/\\/ 100 pips take profit\\ninput int InpSpreadMax = 5; \\/\\/ Maximum spread in pips\\n\\n\\/\\/ Global variables\\nint EMAHandle, SMAHandle, RSIHandle;\\ndatetime LondonNYOverlapStart = DSTime(8, 0); \\/\\/ 8:00 AM EST (London\\/NY overlap start)\\ndatetime LondonNYOverlapEnd = DSTime(12, 0); \\/\\/ 12:00 PM EST (London\\/NY overlap end)\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n  {\\n\\/\\/--- Initialize indicators\\n   EMAHandle = iMA(NULL, 0, InpEMA, 0, MODE_EMA, PRICE_CLOSE);\\n   SMAHandle = iMA(NULL, 0, InpSMA, 0, MODE_SMA, PRICE_CLOSE);\\n   RSIHandle = iRSI(NULL, 0, InpRSI, PRICE_CLOSE);\\n\\n\\/\\/--- Check for errors\\n   if (EMAHandle == INVALID_HANDLE || SMAHandle == INVALID_HANDLE || RSIHandle == INVALID_HANDLE)\\n     {\\n      Print(\\\"Error initializing indicators\\\");\\n      return(INIT_FAILED);\\n     }\\n\\n\\/\\/---\\n   return(INIT_SUCCEEDED);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n  {\\n\\/\\/--- Release indicators\\n   IndicatorRelease(EMAHandle);\\n   IndicatorRelease(SMAHandle);\\n   IndicatorRelease(RSIHandle);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n  {\\n\\/\\/--- Check for London\\/NY overlap and maximum spread\\n   if (!(IsLondonNYOverlap()) || (SymbolInfoDouble(_Symbol, SYMBOL_ASK) - SymbolInfoDouble(_Symbol, SYMBOL_BID) > InpSpreadMax * Point))\\n     return;\\n\\n\\/\\/--- Get indicator values\\n   double EMAValue = iMA(NULL, 0, InpEMA, 0, MODE_EMA, PRICE_CLOSE, 0);\\n   double SMAValue = iMA(NULL, 0, InpSMA, 0, MODE_SMA, PRICE_CLOSE, 0);\\n   double RSIValue = iRSI(NULL, 0, InpRSI, PRICE_CLOSE, 0);\\n\\n\\/\\/--- Check for buy conditions\\n   if (PositionSelect(_Symbol) <= 0 &&\\n       EMAValue > SMAValue &&\\n       RSIValue > 40)\\n     {\\n      double Lots = CalculateLots(InpRisk);\\n      int Ticket = OrderSend(_Symbol, OP_BUY, Lots, Ask, 3, 0, 0, \\\"Buy Order\\\", 0, 0, clrGreen);\\n      if (Ticket < 0)\\n         Print(\\\"OrderSend failed with error #\\\", GetLastError());\\n      else\\n         Print(\\\"Buy order opened successfully\\\");\\n     }\\n\\n\\/\\/--- Check for sell conditions\\n   if (PositionSelect(_Symbol) <= 0 &&\\n       EMAValue < SMAValue &&\\n       RSIValue < 60)\\n     {\\n      double Lots = CalculateLots(InpRisk);\\n      int Ticket = OrderSend(_Symbol, OP_SELL, Lots, Bid, 3, 0, 0, \\\"Sell Order\\\", 0, 0, clrRed);\\n      if (Ticket < 0)\\n         Print(\\\"OrderSend failed with error #\\\", GetLastError());\\n      else\\n         Print(\\\"Sell order opened successfully\\\");\\n     }\\n\\n\\/\\/--- Check for open positions and manage stop loss and take profit\\n   if (PositionSelect(_Symbol) > 0)\\n     {\\n      TradePositionModify();\\n     }\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for London\\/NY overlap                                      |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondonNYOverlap()\\n  {\\n   datetime currentTime = TimeCurrent();\\n   return (currentTime >= LondonNYOverlapStart && currentTime <= LondonNYOverlapEnd);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lots based on risk percentage                          |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLots(double riskPercentage)\\n  {\\n   double accountBalance = AccountInfoDouble(ACCOUNT_BALANCE);\\n   double riskAmount = accountBalance * riskPercentage \\/ 100.0;\\n   double pipValue = SymbolInfoDouble(_Symbol, SYMBOL_TRADE_TICK_VALUE);\\n   double lots = riskAmount \\/ (InpSL * pipValue);\\n   return (lots);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Modify trade position with stop loss and take profit             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid TradePositionModify()\\n  {\\n   int ticket = PositionGetInteger(POSITION_TICKET);\\n   double sl = 0, tp = 0;\\n\\n   if (PositionGetInteger(POSITION_TYPE) == POSITION_TYPE_BUY)\\n     {\\n      sl = Bid - InpSL * Point;\\n      tp = Ask + InpTP * Point;\\n     }\\n   else\\n     {\\n      sl = Ask + InpSL * Point;\\n      tp = Bid - InpTP * Point;\\n     }\\n\\n   bool modified = OrderModify(ticket, PositionGetInteger(POSITION_TYPE) == POSITION_TYPE_BUY ? OrderType(BUY) : OrderType(SELL),\\n                               Bid, Ask, sl, tp, clrNONE);\\n\\n   if (!modified)\\n      Print(\\\"OrderModify failed with error #\\\", GetLastError());\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\\n```\",\"description\":\"\\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\"}', '[]', '2025-08-01 16:34:44', '2025-08-01 16:34:44', '2025-08-01 16:34:44'),
