(51, 20, 'EA:  \"I want to trade using 20 EMA and 50 SMA with RSI...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                      EMA_SMA_RSI_EA.mq4          |\\n\\/\\/|                        Copyright 2023, MetaTrader 4 User         |\\n\\/\\/|                                             https:\\/\\/www.mql5.com  |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaTrader 4 User\\\"\\n#property link      \\\"https:\\/\\/www.mql5.com\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpEMA_Period = 20;\\ninput int InpSMA_Period = 50;\\ninput int InpRSI_Period = 14;\\ninput double InpRiskPercent = 2.0;\\ninput int InpStopLossPips = 50;\\ninput int InpTakeProfitPips = 100;\\ninput int InpMaxSpread = 5;\\ninput int InpLondon_NY_Start = 8;   \\/\\/ 8 AM GMT\\ninput int InpLondon_NY_End = 17;    \\/\\/ 5 PM GMT\\n\\n\\/\\/ Global variables\\nint EMA_Handle, SMA_Handle, RSI_Handle;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialize indicators\\n   EMA_Handle = iMA(NULL, 0, InpEMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   SMA_Handle = iMA(NULL, 0, InpSMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   RSI_Handle = iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE);\\n\\n   if(EMA_Handle == INVALID_HANDLE || SMA_Handle == INVALID_HANDLE || RSI_Handle == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error initializing indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicators\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if within London\\/NY overlap and spread is acceptable\\n   if(!IsLondon_NY_Overlap() || SymbolInfoDouble(_Symbol, SYMBOL_ASK) - SymbolInfoDouble(_Symbol, SYMBOL_BID) > InpMaxSpread * Point)\\n      return;\\n\\n   \\/\\/ Get indicator values\\n   double EMA_Buffer[], SMA_Buffer[], RSI_Buffer[];\\n   CopyBuffer(EMA_Handle, 0, 0, 3, EMA_Buffer);\\n   CopyBuffer(SMA_Handle, 0, 0, 3, SMA_Buffer);\\n   CopyBuffer(RSI_Handle, 0, 0, 1, RSI_Buffer);\\n\\n   \\/\\/ Check for buy condition\\n   if(EMA_Buffer[1] <= SMA_Buffer[1] && EMA_Buffer[0] > SMA_Buffer[0] && RSI_Buffer[0] > 40)\\n   {\\n      double lotSize = CalculateLotSize(InpRiskPercent, InpStopLossPips);\\n      OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, Ask - InpStopLossPips * Point, Ask + InpTakeProfitPips * Point, \\\"Buy Order\\\", 0, 0, clrGreen);\\n   }\\n   \\/\\/ Check for sell condition\\n   else if(EMA_Buffer[1] >= SMA_Buffer[1] && EMA_Buffer[0] < SMA_Buffer[0] && RSI_Buffer[0] < 60)\\n   {\\n      double lotSize = CalculateLotSize(InpRiskPercent, InpStopLossPips);\\n      OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, Bid + InpStopLossPips * Point, Bid - InpTakeProfitPips * Point, \\\"Sell Order\\\", 0, 0, clrRed);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check if within London\\/NY overlap hours                           |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondon_NY_Overlap()\\n{\\n   MqlDateTime timeStruct;\\n   TimeCurrent(timeStruct);\\n   int hour = timeStruct.hour;\\n\\n   return (hour >= InpLondon_NY_Start && hour < InpLondon_NY_End);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                       |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize(double riskPercent, int stopLossPips)\\n{\\n   double balance = AccountBalance();\\n   double riskAmount = balance * riskPercent \\/ 100.0;\\n   double pipValue = SymbolInfoDouble(_Symbol, SYMBOL_TRADE_TICK_VALUE) * Point;\\n   return(riskAmount \\/ (stopLossPips * pipValue));\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\" \\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\"}', '[]', '2025-08-04 03:57:58', '2025-08-04 03:57:58', '2025-08-04 03:57:58'),
(52, 20, 'EA:  \"I want to trade using 20 EMA and 50 SMA with RSI...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EMARSIRobot.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                               https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n#property strict\\n\\n\\/\\/ Input parameters\\ninput int      InpEMA_Period = 20;\\ninput int      InpSMA_Period = 50;\\ninput int      InpRSI_Period = 14;\\ninput double   InpRiskPercent = 2.0;\\ninput int      InpSL_Pips = 50;\\ninput int      InpTP_Pips = 100;\\ninput int      InpMaxSpread = 5;\\ninput string   InpSessionStart = \\\"08:00\\\";\\ninput string   InpSessionEnd = \\\"17:00\\\";\\n\\n\\/\\/ Global variables\\nint EMA_Handle, SMA_Handle, RSI_Handle;\\ndouble EMA[], SMA[], RSI[];\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n  {\\n   \\/\\/ Create indicators\\n   EMA_Handle = iMA(NULL, 0, InpEMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   SMA_Handle = iMA(NULL, 0, InpSMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   RSI_Handle = iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE);\\n\\n   \\/\\/ Check for errors\\n   if(EMA_Handle == INVALID_HANDLE || SMA_Handle == INVALID_HANDLE || RSI_Handle == INVALID_HANDLE)\\n     {\\n      Print(\\\"Error creating indicators\\\");\\n      return(INIT_FAILED);\\n     }\\n\\n   return(INIT_SUCCEEDED);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n  {\\n   \\/\\/ Release indicators\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n  {\\n   \\/\\/ Check for London\\/NY overlap session\\n   if(!IsInSession())\\n     return;\\n\\n   \\/\\/ Check for spread\\n   if(Ask - Bid > InpMaxSpread * Point)\\n     return;\\n\\n   \\/\\/ Get indicator values\\n   CopyBuffer(EMA_Handle, 0, 0, 3, EMA);\\n   CopyBuffer(SMA_Handle, 0, 0, 3, SMA);\\n   CopyBuffer(RSI_Handle, 0, 0, 3, RSI);\\n\\n   \\/\\/ Check for buy signal\\n   if(IsBuySignal())\\n     {\\n      if(PositionSelect(_Symbol) <= 0)\\n        {\\n         double lotSize = CalculateLotSize(InpRiskPercent, InpSL_Pips);\\n         double sl = Bid - InpSL_Pips * Point;\\n         double tp = Bid + InpTP_Pips * Point;\\n         OrderSend(_Symbol, OP_BUY, lotSize, Ask, 3, sl, tp, \\\"EMA_RSI Buy\\\", 0, 0, clrGreen);\\n        }\\n     }\\n\\n   \\/\\/ Check for sell signal\\n   if(IsSellSignal())\\n     {\\n      if(PositionSelect(_Symbol) <= 0)\\n        {\\n         double lotSize = CalculateLotSize(InpRiskPercent, InpSL_Pips);\\n         double sl = Ask + InpSL_Pips * Point;\\n         double tp = Ask - InpTP_Pips * Point;\\n         OrderSend(_Symbol, OP_SELL, lotSize, Bid, 3, sl, tp, \\\"EMA_RSI Sell\\\", 0, 0, clrRed);\\n        }\\n     }\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check if in London\\/NY overlap session                            |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsInSession()\\n  {\\n   MqlDateTime time;\\n   TimeCurrent(time);\\n   string currentTime = TimeToString(time.hour, TIME_DATE) + \\\":\\\" + TimeToString(time.min, TIME_MINUTES);\\n\\n   if(currentTime >= InpSessionStart && currentTime <= InpSessionEnd)\\n     return true;\\n\\n   return false;\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for buy signal                                             |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsBuySignal()\\n  {\\n   if(EMA[1] <= SMA[1] && EMA[0] > SMA[0] && RSI[0] > 40)\\n     return true;\\n\\n   return false;\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for sell signal                                            |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsSellSignal()\\n  {\\n   if(EMA[1] >= SMA[1] && EMA[0] < SMA[0] && RSI[0] < 60)\\n     return true;\\n\\n   return false;\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percent                         |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize(double riskPercent, int slPips)\\n  {\\n   double balance = AccountBalance();\\n   double riskAmount = balance * riskPercent \\/ 100;\\n   double pipValue = SymbolInfoDouble(_Symbol, SYMBOL_TRADE_TICK_VALUE) * SymbolInfoInteger(_Symbol, SYMBOL_TRADE_TICK_SIZE);\\n   double lotSize = riskAmount \\/ (slPips * pipValue);\\n\\n   return MathFloor(lotSize * 100) \\/ 100; \\/\\/ Round to 2 decimal places\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\" \\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\\n\"}', '[]', '2025-08-04 04:37:53', '2025-08-04 04:37:53', '2025-08-04 04:37:53'),
