(69, 20, 'EA: ', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      BlockchainEA.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int      LotSize = 0.1;               \\/\\/ Lot size\\ninput int      StopLoss = 100;              \\/\\/ Stop loss in points\\ninput int      TakeProfit = 200;            \\/\\/ Take profit in points\\ninput int      TrailingStop = 50;           \\/\\/ Trailing stop in points\\ninput int      MagicNumber = 12345;         \\/\\/ Magic number for the EA\\n\\n\\/\\/ Global variables\\nint ticket;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if there\'s an open position\\n   if(PositionsTotal() == 0)\\n   {\\n      \\/\\/ Check for buy signal\\n      if(CheckBuySignal())\\n      {\\n         \\/\\/ Open buy order\\n         OpenOrder(OP_BUY);\\n      }\\n      \\/\\/ Check for sell signal\\n      else if(CheckSellSignal())\\n      {\\n         \\/\\/ Open sell order\\n         OpenOrder(OP_SELL);\\n      }\\n   }\\n   else\\n   {\\n      \\/\\/ Check for trailing stop\\n      CheckTrailingStop();\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Open order function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenOrder(int cmd)\\n{\\n   double price = (cmd == OP_BUY) ? Ask : Bid;\\n   double sl = (cmd == OP_BUY) ? price - StopLoss * Point : price + StopLoss * Point;\\n   double tp = (cmd == OP_BUY) ? price + TakeProfit * Point : price - TakeProfit * Point;\\n\\n   ticket = OrderSend(Symbol(), cmd, LotSize, price, 3, sl, tp, \\\"Blockchain EA\\\", MagicNumber, 0, clrNONE);\\n   if(ticket < 0)\\n   {\\n      Print(\\\"OrderSend failed with error #\\\", GetLastError());\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check buy signal function                                        |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckBuySignal()\\n{\\n   \\/\\/ Implement your buy signal logic here\\n   \\/\\/ For example, you can use moving averages, RSI, MACD, etc.\\n   return(true); \\/\\/ Replace with actual buy signal condition\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check sell signal function                                       |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckSellSignal()\\n{\\n   \\/\\/ Implement your sell signal logic here\\n   \\/\\/ For example, you can use moving averages, RSI, MACD, etc.\\n   return(true); \\/\\/ Replace with actual sell signal condition\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check trailing stop function                                     |\\n\\/\\/+------------------------------------------------------------------+\\nvoid CheckTrailingStop()\\n{\\n   for(int i = OrdersTotal() - 1; i >= 0; i--)\\n   {\\n      if(OrderSelect(i, SELECT_BY_POS, MODE_TRADES) && OrderSymbol() == Symbol() && OrderMagicNumber() == MagicNumber)\\n      {\\n         double currentPrice = (OrderType() == OP_BUY) ? Bid : Ask;\\n         double diff = MathAbs(OrderOpenPrice() - currentPrice) * Point;\\n\\n         if(diff >= TrailingStop)\\n         {\\n            double newStopLoss = (OrderType() == OP_BUY) ? currentPrice - TrailingStop * Point : currentPrice + TrailingStop * Point;\\n            OrderModify(OrderTicket(), OrderOpenPrice(), newStopLoss, OrderTakeProfit(), 0, clrNONE);\\n         }\\n      }\\n   }\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"\\u6211\\u60f3\\u8981\\u6295\\u8cc7\\u5340\\u584a\\u93c8\"}', '[]', '2025-08-05 14:53:47', '2025-08-05 14:53:47', '2025-08-05 14:53:47'),
