(89, 21, 'EA: 10 pips a day with CCI and MACD is a Volatility Mo...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      10PipsADay.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput string      InpCurrencyPair = \\\"EURUSD\\\";     \\/\\/ Currency pair\\ninput ENUM_TIMEFRAMES InpTimeFrame = PERIOD_M1;  \\/\\/ Time frame\\ninput int InpStopLossPips = 3;                   \\/\\/ Stop loss in pips\\ninput double InpTakeProfitPips = 10;              \\/\\/ Take profit in pips (for EURUSD)\\ninput int InpBBDeviation1 = 1;                    \\/\\/ Bollinger Bands deviation 1\\ninput int InpBBDeviation2 = 2;                    \\/\\/ Bollinger Bands deviation 2\\ninput int InpStochK = 5;                          \\/\\/ Stochastic K period\\ninput int InpStochD = 3;                          \\/\\/ Stochastic D period\\ninput int InpStochSlowing = 3;                    \\/\\/ Stochastic slowing\\n\\n\\/\\/ Global variables\\ndouble BB_Upper1, BB_Lower1, BB_Upper2, BB_Lower2;\\ndouble StochD;\\nint handleBB1, handleBB2, handleStoch;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialize indicators\\n   handleBB1 = iBands(NULL, InpTimeFrame, 20, InpBBDeviation1, 0, PRICE_CLOSE);\\n   handleBB2 = iBands(NULL, InpTimeFrame, 20, InpBBDeviation2, 0, PRICE_CLOSE);\\n   handleStoch = iStochastic(NULL, InpTimeFrame, InpStochK, InpStochD, InpStochSlowing, MODE_SMA, STO_LOWD, 0);\\n\\n   if (handleBB1 == INVALID_HANDLE || handleBB2 == INVALID_HANDLE || handleStoch == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error initializing indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicator handles\\n   IndicatorRelease(handleBB1);\\n   IndicatorRelease(handleBB2);\\n   IndicatorRelease(handleStoch);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Get indicator values\\n   if (CopyBuffer(handleBB1, 0, 0, 3, BB_Upper1) != 3 ||\\n       CopyBuffer(handleBB1, 1, 0, 3, BB_Lower1) != 3 ||\\n       CopyBuffer(handleBB2, 0, 0, 3, BB_Upper2) != 3 ||\\n       CopyBuffer(handleBB2, 1, 0, 3, BB_Lower2) != 3 ||\\n       CopyBuffer(handleStoch, 0, 0, 2, StochD) != 2)\\n   {\\n      Print(\\\"Error copying indicator values\\\");\\n      return;\\n   }\\n\\n   \\/\\/ Check for open positions\\n   if (PositionsTotal() > 0)\\n      return;\\n\\n   \\/\\/ Check for long entry conditions\\n   if (CheckLongEntry())\\n   {\\n      double stopLoss = BB_Lower2 - (InpStopLossPips * Point);\\n      double takeProfit = Ask + (InpTakeProfitPips * Point);\\n      OrderSend(Symbol(), OP_BUY, 0.1, Ask, 3, stopLoss, takeProfit, \\\"Long Entry\\\", 0, 0, clrGreen);\\n   }\\n   \\/\\/ Check for short entry conditions\\n   else if (CheckShortEntry())\\n   {\\n      double stopLoss = BB_Upper2 + (InpStopLossPips * Point);\\n      double takeProfit = Bid - (InpTakeProfitPips * Point);\\n      OrderSend(Symbol(), OP_SELL, 0.1, Bid, 3, stopLoss, takeProfit, \\\"Short Entry\\\", 0, 0, clrRed);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for long entry conditions                                 |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckLongEntry()\\n{\\n   \\/\\/ Check condition 1: low of the bar is lower than the lower Bollinger band (deviation 1)\\n   if (Low[1] >= BB_Lower1[1])\\n      return false;\\n\\n   \\/\\/ Check condition 2: Stochastic D is lower than 20 or crosses up from the bottom\\n   if (StochD[1] >= 20 && StochD[0] >= StochD[1])\\n      return false;\\n\\n   \\/\\/ Check condition 3: previous candle close is at least 4 pips (1 min) or 8 pips (5 min) lower than the current candle\\n   double pipDiff = (InpTimeFrame == PERIOD_M1) ? 4 * Point : 8 * Point;\\n   if (Close[1] >= Close[0] + pipDiff)\\n      return false;\\n\\n   return true;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for short entry conditions                                |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckShortEntry()\\n{\\n   \\/\\/ Check condition 1: high of the current bar is higher than the upper Bollinger band (deviation 1)\\n   if (High[1] <= BB_Upper1[1])\\n      return false;\\n\\n   \\/\\/ Check condition 2: Stochastic D is higher than 80 or crosses down from the top\\n   if (StochD[1] <= 80 && StochD[0] <= StochD[1])\\n      return false;\\n\\n   \\/\\/ Check condition 3: previous candle close is at least 4 pips (1 min) or 8 pips (5 min) higher than the current candle\\n   double pipDiff = (InpTimeFrame == PERIOD_M1) ? 4 * Point : 8 * Point;\\n   if (Close[1] <= Close[0] - pipDiff)\\n      return false;\\n\\n   return true;\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"10 pips a day with CCI and MACD is a Volatility Momentum forex strategy.\\n\\nTime Frame 1 min or 5 min.\\n\\nCurrency pairs: EUR\\/USD, USD\\/CHF\\n\\nForex Indicators:\\n\\nBollinger Bands: (1, 20;);\\n\\nBollinger Band: (2, 20);\\n\\nStochastic (5,3,3).\\n\\n \\n\\n\\n \\n\\nSETUP (EUR\\/USD)\\n\\nLong Entry\\n\\n1) the low of the bar is lower than the lower bollinger bands (deviation 1);\\n\\n \\n\\n2) the Fast Stochastics (line D) is lower than 20 or cross up from the bottom;\\n\\n3) if you look back their the previous candle is with a close at least 4 pips lower than the current candle (1 min time frame) and a close at least 8 pips lower the current candle (5 min time frame).(USD\\/CHF 3 pips 1min, and 5 pips 5min).\\n\\nShort Entry\\n\\n1) the high of the current bar is higher than the upper bollinger bands (deviation 1);\\n\\n                         \\n\\n2) the Fast Stochastics (line D) is higher than 80 or cross up from the bottom;\\n\\n                        \\n\\n3) if you look back their the previous candle is with a close at least 4 pips upper than the currentcandle (5 min time frame) and a close at least 8 pips upper the current candle (5 min time frame). (USD\\/CHF 3 pips 1min, and 5 pips 5min).\\n\\n\\nThe Trading System closes a long when\\n\\n1)  the high of the candle broken  the upper bollinger band deviation 1 or touches the upper bollinger band deviation 2.\\n\\n2) Stop loss on 3 pips below the lower bands of the BB deviation 2.\\n\\nThe Forex System closes a short when\\n\\n1)  the high of the candle broken  the lower bollinger bands deviation 1 or touches the lower bollinger band deviation 2.\\n\\n2) Stop loss on 3 pips above the lower bands of the BB deviation 2 or 10 pips EUR\\/USD and 8 pips USD\\/CHF.\"}', '[]', '2025-08-09 09:00:49', '2025-08-09 09:00:49', '2025-08-09 09:00:49'),
(90, 21, 'EA: make an mql5', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql5\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      MyEA.mq5   |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput double LotSize = 0.1;          \\/\\/ Lot size\\ninput int    StopLoss = 100;         \\/\\/ Stop loss in points\\ninput int    TakeProfit = 200;       \\/\\/ Take profit in points\\ninput int    MagicNumber = 12345;    \\/\\/ Magic number for the EA\\n\\n\\/\\/ Global variables\\nint tradeTicket = 0;                 \\/\\/ Ticket of the current trade\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialization code here\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Deinitialization code here\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if there is an open trade\\n   if(tradeTicket > 0)\\n   {\\n      \\/\\/ Check if the trade is still open\\n      if(!OrderSelect(tradeTicket, SELECT_BY_TICKET, MODE_TRADES))\\n      {\\n         tradeTicket = 0;\\n      }\\n   }\\n\\n   \\/\\/ Check for open positions\\n   if(PositionsTotal() == 0)\\n   {\\n      \\/\\/ Check for buy signal\\n      if(CheckBuySignal())\\n      {\\n         OpenTrade(ORDER_TYPE_BUY);\\n      }\\n      \\/\\/ Check for sell signal\\n      else if(CheckSellSignal())\\n      {\\n         OpenTrade(ORDER_TYPE_SELL);\\n      }\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Function to open a trade                                         |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenTrade(ENUM_ORDER_TYPE orderType)\\n{\\n   MqlTradeRequest request = {0};\\n   MqlTradeResult result = {0};\\n\\n   request.action = TRADE_ACTION_DEAL;\\n   request.symbol = _Symbol;\\n   request.volume = LotSize;\\n   request.type = orderType;\\n   request.price = (orderType == ORDER_TYPE_BUY) ? SymbolInfoDouble(_Symbol, SYMBOL_ASK) : SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n   request.deviation = 10;\\n   request.magic = MagicNumber;\\n   request.sl = (orderType == ORDER_TYPE_BUY) ? request.price - StopLoss * _Point : request.price + StopLoss * _Point;\\n   request.tp = (orderType == ORDER_TYPE_BUY) ? request.price + TakeProfit * _Point : request.price - TakeProfit * _Point;\\n\\n   if(!OrderSend(request, result))\\n   {\\n      Print(\\\"OrderSend failed with error #\\\", GetLastError());\\n   }\\n   else\\n   {\\n      tradeTicket = result.deal;\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Function to check for buy signal                                  |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckBuySignal()\\n{\\n   \\/\\/ Implement your buy signal logic here\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Function to check for sell signal                                 |\\n\\/\\/+------------------------------------------------------------------+\\nbool CheckSellSignal()\\n{\\n   \\/\\/ Implement your sell signal logic here\\n   return false;\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"make an mql5\"}', '[]', '2025-08-09 09:01:49', '2025-08-09 09:01:49', '2025-08-09 09:01:49'),
(91, 21, 'EA: fix issues \"MODE_TRADES\" - Undeclared indentifier', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      FixMT4.mq4   |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/--- input parameters\\ninput int      InpMagicNumber=123456;  \\/\\/ Magic number\\ninput double   InpLotSize=0.1;         \\/\\/ Lot size\\ninput int      InpStopLoss=100;        \\/\\/ Stop loss in points\\ninput int      InpTakeProfit=200;      \\/\\/ Take profit in points\\ninput int      InpTrailingStop=50;     \\/\\/ Trailing stop in points\\ninput int      InpSlippage=3;          \\/\\/ Slippage in points\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n  {\\n   return(INIT_SUCCEEDED);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n  {\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n  {\\n   static datetime lastbar=0;\\n   if(lastbar==iTime(NULL,0,iTime(NULL,0,0)))\\n      return;\\n   lastbar=iTime(NULL,0,0);\\n\\n   \\/\\/--- check for open positions\\n   if(PositionSelect(_Symbol))\\n     {\\n      \\/\\/--- check for stop loss and take profit\\n      if(SymbolInfoDouble(_Symbol,SYMBOL_BID)-PositionGetDouble(POSITION_PRICE_OPEN)>=InpTakeProfit*_Point)\\n        {\\n         if(!OrderSend(_Symbol,OP_SELL,PositionGetDouble(POSITION_VOLUME),SymbolInfoDouble(_Symbol,SYMBOL_BID),3,0,0,\\\"\\\",0,0,clrNONE))\\n           Print(\\\"Take profit order failed with error #\\\",GetLastError());\\n        }\\n      else if(PositionGetDouble(POSITION_PRICE_OPEN)-SymbolInfoDouble(_Symbol,SYMBOL_ASK)>=InpStopLoss*_Point)\\n        {\\n         if(!OrderSend(_Symbol,OP_BUY,PositionGetDouble(POSITION_VOLUME),SymbolInfoDouble(_Symbol,SYMBOL_ASK),3,0,0,\\\"\\\",0,0,clrNONE))\\n           Print(\\\"Stop loss order failed with error #\\\",GetLastError());\\n        }\\n\\n      \\/\\/--- check for trailing stop\\n      if(PositionGetInteger(POSITION_TYPE)==POSITION_TYPE_BUY)\\n        {\\n         if(SymbolInfoDouble(_Symbol,SYMBOL_BID)-PositionGetDouble(POSITION_PRICE_OPEN)>=InpTrailingStop*_Point)\\n           {\\n            if(!OrderSend(_Symbol,OP_BUY,PositionGetDouble(POSITION_VOLUME),SymbolInfoDouble(_Symbol,SYMBOL_BID)-InpTrailingStop*_Point,3,0,0,\\\"\\\",0,0,clrNONE))\\n              Print(\\\"Trailing stop order failed with error #\\\",GetLastError());\\n           }\\n        }\\n      else if(PositionGetInteger(POSITION_TYPE)==POSITION_TYPE_SELL)\\n        {\\n         if(PositionGetDouble(POSITION_PRICE_OPEN)-SymbolInfoDouble(_Symbol,SYMBOL_ASK)>=InpTrailingStop*_Point)\\n           {\\n            if(!OrderSend(_Symbol,OP_SELL,PositionGetDouble(POSITION_VOLUME),SymbolInfoDouble(_Symbol,SYMBOL_ASK)+InpTrailingStop*_Point,3,0,0,\\\"\\\",0,0,clrNONE))\\n              Print(\\\"Trailing stop order failed with error #\\\",GetLastError());\\n           }\\n        }\\n     }\\n   else\\n     {\\n      \\/\\/--- open new position\\n      if(SomeConditionToOpenPosition())\\n        {\\n         if(OrderSend(_Symbol,OP_BUY,InpLotSize,SymbolInfoDouble(_Symbol,SYMBOL_ASK),3,InpStopLoss*_Point,InpTakeProfit*_Point,\\\"\\\",0,0,clrNONE))\\n           Print(\\\"OrderSend failed with error #\\\",GetLastError());\\n        }\\n     }\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Custom function to determine when to open a position             |\\n\\/\\/+------------------------------------------------------------------+\\nbool SomeConditionToOpenPosition()\\n  {\\n   \\/\\/--- replace with your own condition to open a position\\n   return(true);\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"fix issues \\\"MODE_TRADES\\\" - Undeclared indentifier\"}', '[]', '2025-08-09 09:04:43', '2025-08-09 09:04:43', '2025-08-09 09:04:43'),
(92, 21, 'EA: MT5', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql5\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      MyTrendEA.mq5 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpMAPeriod = 14;          \\/\\/ Moving Average Period\\ninput int InpMAMethod = MODE_SMA;    \\/\\/ Moving Average Method\\ninput ENUM_APPLIED_PRICE InpMAPrice = PRICE_CLOSE; \\/\\/ Applied Price\\ninput double InpLotSize = 0.1;       \\/\\/ Lot Size\\ninput int InpStopLoss = 100;         \\/\\/ Stop Loss (points)\\ninput int InpTakeProfit = 200;       \\/\\/ Take Profit (points)\\ninput int InpTrailingStop = 50;      \\/\\/ Trailing Stop (points)\\n\\n\\/\\/ Global variables\\nint handleMA;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Create the Moving Average handle\\n   handleMA = iMA(NULL, 0, InpMAPeriod, 0, InpMAMethod, InpMAPrice);\\n\\n   if (handleMA == INVALID_HANDLE)\\n   {\\n      Print(\\\"Failed to create Moving Average handle\\\");\\n      return INIT_FAILED;\\n   }\\n\\n   return INIT_SUCCEEDED;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release the Moving Average handle\\n   if (handleMA != INVALID_HANDLE)\\n      IndicatorRelease(handleMA);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if we have open positions\\n   if (PositionsTotal() > 0)\\n   {\\n      \\/\\/ Manage open positions\\n      ManagePositions();\\n   }\\n   else\\n   {\\n      \\/\\/ Check for new trading opportunities\\n      CheckForTrades();\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for new trading opportunities                              |\\n\\/\\/+------------------------------------------------------------------+\\nvoid CheckForTrades()\\n{\\n   double maValue[];\\n   CopyBuffer(handleMA, 0, 0, 1, maValue);\\n\\n   double currentPrice = SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n\\n   \\/\\/ Check if the price is above the Moving Average (buy signal)\\n   if (currentPrice > maValue[0])\\n   {\\n      \\/\\/ Place a buy order\\n      PlaceOrder(ORDER_TYPE_BUY);\\n   }\\n   \\/\\/ Check if the price is below the Moving Average (sell signal)\\n   else if (currentPrice < maValue[0])\\n   {\\n      \\/\\/ Place a sell order\\n      PlaceOrder(ORDER_TYPE_SELL);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Manage open positions                                            |\\n\\/\\/+------------------------------------------------------------------+\\nvoid ManagePositions()\\n{\\n   for (int i = PositionsTotal() - 1; i >= 0; i--)\\n   {\\n      ulong positionTicket = PositionGetTicket(i);\\n      double positionPrice = PositionGetDouble(POSITION_PRICE_OPEN);\\n      double currentPrice = SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n      ENUM_POSITION_TYPE positionType = (ENUM_POSITION_TYPE)PositionGetInteger(POSITION_TYPE);\\n\\n      \\/\\/ Check if the position is profitable enough for trailing stop\\n      if (positionType == POSITION_TYPE_BUY && currentPrice - positionPrice >= InpTrailingStop * _Point)\\n      {\\n         \\/\\/ Modify the stop loss to trail the price\\n         double newStopLoss = currentPrice - InpTrailingStop * _Point;\\n         PositionModify(positionTicket, positionPrice, newStopLoss, 0, 0);\\n      }\\n      else if (positionType == POSITION_TYPE_SELL && positionPrice - currentPrice >= InpTrailingStop * _Point)\\n      {\\n         \\/\\/ Modify the stop loss to trail the price\\n         double newStopLoss = currentPrice + InpTrailingStop * _Point;\\n         PositionModify(positionTicket, positionPrice, newStopLoss, 0, 0);\\n      }\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Place a new order                                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid PlaceOrder(ENUM_ORDER_TYPE orderType)\\n{\\n   MqlTradeRequest request = {};\\n   MqlTradeResult result = {};\\n\\n   request.action = TRADE_ACTION_DEAL;\\n   request.symbol = _Symbol;\\n   request.volume = InpLotSize;\\n   request.type = orderType;\\n   request.price = (orderType == ORDER_TYPE_BUY) ? SymbolInfoDouble(_Symbol, SYMBOL_ASK) : SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n   request.sl = (orderType == ORDER_TYPE_BUY) ? request.price - InpStopLoss * _Point : request.price + InpStopLoss * _Point;\\n   request.tp = (orderType == ORDER_TYPE_BUY) ? request.price + InpTakeProfit * _Point : request.price - InpTakeProfit * _Point;\\n   request.deviation = 10;\\n   request.magic = 12345;\\n   request.comment = \\\"MyTrendEA\\\";\\n\\n   if (!OrderSend(request, result))\\n   {\\n      Print(\\\"OrderSend failed with error #\\\", GetLastError());\\n   }\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"MT5\"}', '[]', '2025-08-09 09:05:44', '2025-08-09 09:05:44', '2025-08-09 09:05:44'),
