MA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   RSI_Handle = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE);\\n\\n   if(EMA_Handle == INVALID_HANDLE || SMA_Handle == INVALID_HANDLE || RSI_Handle == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error creating indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicators\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check for London\\/NY overlap\\n   datetime currentTime = TimeCurrent();\\n   datetime startTime = London_NY_Start;\\n   datetime endTime = London_NY_End;\\n\\n   \\/\\/ Set the year to current year\\n   startTime = TimeCurrentYear(startTime);\\n   endTime = TimeCurrentYear(endTime);\\n\\n   if(currentTime < startTime || currentTime > endTime)\\n      return;\\n\\n   \\/\\/ Check spread\\n   double spread = MarketInfo(Symbol(), MODE_SPREAD) * Point;\\n   if(spread > MaxSpread * Point)\\n      return;\\n\\n   \\/\\/ Get indicator values\\n   double ema = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE, 1);\\n   double sma = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE, 1);\\n   double rsi = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE, 1);\\n\\n   \\/\\/ Check for buy signal\\n   if(ema > sma && ema[1] <= sma[1] && rsi > 40 && PositionsTotal() == 0)\\n   {\\n      double accountBalance = AccountBalance();\\n      double riskAmount = accountBalance * RiskPercent \\/ 100.0;\\n      double lotSize = riskAmount \\/ (StopLoss * Point * SymbolInfoDouble(_Symbol, SYMBOL_TRADE_TICK_VALUE) * 10);\\n\\n      if(lotSize < LotSize)\\n         lotSize = LotSize;\\n\\n      double sl = Ask - StopLoss * Point;\\n      double tp = Ask + TakeProfit * Point;\\n\\n      OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, sl, tp, \\\"Buy Order\\\", 0, 0, clrGreen);\\n   }\\n   \\/\\/ Check for sell signal\\n   else if(ema < sma && ema[1] >= sma[1] && rsi < 60 && PositionsTotal() == 0)\\n   {\\n      double accountBalance = AccountBalance();\\n      double riskAmount = accountBalance * RiskPercent \\/ 100.0;\\n      double lotSize = riskAmount \\/ (StopLoss * Point * SymbolInfoDouble(_Symbol, SYMBOL_TRADE_TICK_VALUE) * 10);\\n\\n      if(lotSize < LotSize)\\n         lotSize = LotSize;\\n\\n      double sl = Bid + StopLoss * Point;\\n      double tp = Bid - TakeProfit * Point;\\n\\n      OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, sl, tp, \\\"Sell Order\\\", 0, 0, clrRed);\\n   }\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\"}', '[]', '2025-08-15 09:02:34', '2025-08-15 09:02:34', '2025-08-15 09:02:34'),
