(146, 23, 'EA: I want to trade using RSI(14) H4 and M15. Buy when...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      RSI_EA.mq4   |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int      InpRSI_Period=14;       \\/\\/ RSI Period\\ninput int      InpRSI_BuyLevel=25;      \\/\\/ RSI Buy Level\\ninput int      InpRSI_SellLevel=80;     \\/\\/ RSI Sell Level\\ninput double   InpRiskPercent=1.0;      \\/\\/ Risk percentage per trade\\ninput int      InpSL_Pips=50;           \\/\\/ Stop Loss in pips\\ninput int      InpTP_Pips=100;          \\/\\/ Take Profit in pips\\ninput int      InpH4_Timeframe=PERIOD_H4;  \\/\\/ H4 Timeframe\\ninput int      InpM15_Timeframe=PERIOD_M15; \\/\\/ M15 Timeframe\\n\\n\\/\\/ Global variables\\nint             handle_H4, handle_M15;\\ndouble          lotSize;\\ndouble          stopLoss, takeProfit;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n  {\\n   \\/\\/ Get handles for the indicators\\n   handle_H4 = iRSI(_Symbol, InpH4_Timeframe, InpRSI_Period);\\n   handle_M15 = iRSI(_Symbol, InpM15_Timeframe, InpRSI_Period);\\n\\n   if(handle_H4 == INVALID_HANDLE || handle_M15 == INVALID_HANDLE)\\n     {\\n      Print(\\\"Failed to create indicators\\\");\\n      return(INIT_FAILED);\\n     }\\n\\n   return(INIT_SUCCEEDED);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n  {\\n   \\/\\/ Release indicator handles\\n   IndicatorRelease(handle_H4);\\n   IndicatorRelease(handle_M15);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n  {\\n   \\/\\/ Calculate lot size based on risk percentage\\n   lotSize = CalculateLotSize();\\n\\n   \\/\\/ Get RSI values\\n   double rsi_H4 = iRSI(_Symbol, InpH4_Timeframe, InpRSI_Period, 0);\\n   double rsi_M15 = iRSI(_Symbol, InpM15_Timeframe, InpRSI_Period, 0);\\n\\n   \\/\\/ Calculate stop loss and take profit in points\\n   stopLoss = InpSL_Pips * _Point;\\n   takeProfit = InpTP_Pips * _Point;\\n\\n   \\/\\/ Check for buy conditions\\n   if(rsi_H4 > InpRSI_BuyLevel && rsi_M15 > InpRSI_BuyLevel)\\n     {\\n      if(PositionsTotal() == 0) \\/\\/ No open positions\\n        {\\n         \\/\\/ Place buy order\\n         OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, 0, 0, \\\"RSI Buy\\\", 0, 0, clrGreen);\\n        }\\n     }\\n   \\/\\/ Check for sell conditions\\n   else if(rsi_H4 < InpRSI_SellLevel && rsi_M15 < InpRSI_SellLevel)\\n     {\\n      if(PositionsTotal() == 0) \\/\\/ No open positions\\n        {\\n         \\/\\/ Place sell order\\n         OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, 0, 0, \\\"RSI Sell\\\", 0, 0, clrRed);\\n        }\\n     }\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                       |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize()\\n  {\\n   double balance = AccountBalance();\\n   double riskAmount = balance * InpRiskPercent \\/ 100;\\n   double lotSize = riskAmount \\/ (stopLoss * _Point);\\n\\n   \\/\\/ Ensure lot size is within allowed range\\n   lotSize = MathMin(lotSize, AccountFreeMargin() \\/ (10 * _Point)); \\/\\/ 10x leverage\\n   lotSize = MathMin(lotSize, MarketInfo(Symbol(), MODE_MAXLOT));\\n   lotSize = MathMax(lotSize, MarketInfo(Symbol(), MODE_MINLOT));\\n\\n   return(lotSize);\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to trade using RSI(14) H4 and M15. Buy when RSI > 25. Sell when RSI < 80. Use 1% risk per trade, 50 pip SL, 100 pip TP. maximize open positions\"}', '[]', '2025-08-22 01:10:00', '2025-08-22 01:10:00', '2025-08-22 01:10:00'),
