(166, 23, 'EA: I want to create an EA to  push notification when ...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      RSIAlert.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/--- Input Parameters\\ninput int      RSI_Period = 14;      \\/\\/ RSI Period\\ninput int      RSI_Level = 30;       \\/\\/ RSI Level\\ninput string   AlertMessage = \\\"RSI(14) has hit \\\"; \\/\\/ Alert Message\\n\\n\\/\\/--- Global Variables\\nint rsiHandle;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n  {\\n   \\/\\/--- Indicator Handle\\n   rsiHandle = iRSI(_Symbol, _Period, RSI_Period, PRICE_CLOSE);\\n\\n   if(rsiHandle == INVALID_HANDLE)\\n     {\\n      Print(\\\"Failed to create RSI indicator handle\\\");\\n      return(INIT_FAILED);\\n     }\\n\\n   return(INIT_SUCCEEDED);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n  {\\n   \\/\\/--- Release Indicator Handle\\n   IndicatorRelease(rsiHandle);\\n  }\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n  {\\n   \\/\\/--- Get RSI Value\\n   double rsiValue = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE, 0);\\n\\n   \\/\\/--- Check if RSI value is less than or equal to the specified level\\n   if(rsiValue <= RSI_Level)\\n     {\\n      \\/\\/--- Send Alert\\n      Alert(AlertMessage + DoubleToString(rsiValue, 2));\\n     }\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to create an EA to  push notification when RSI(14) hits 30.\"}', '[]', '2025-08-24 03:39:49', '2025-08-24 03:39:49', '2025-08-24 03:39:49'),
