tKillTimer(0); \\/\\/ Kill timer after sending notification\\n     }\\n  }\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to create an EA to push notification when RSI(14) hits certain level. The period and level to be set should be user defined\"}', '[]', '2025-08-24 03:45:14', '2025-08-24 03:45:14', '2025-08-24 03:45:14'),
