des a potential entry point near the support level. The RSI and MACD confirm the bullish momentum.\"}', '[\"https://storage.googleapis.com/ai-crm-windsurf.firebasestorage.app/chart_analysis/23/1756104406_q4vLH6rDvwzcBepdm6QN.jpg\", \"https://storage.googleapis.com/ai-crm-windsurf.firebasestorage.app/chart_analysis/23/1756104407_mw1oDe731rpU8wOnk5cL.jpg\"]', '2025-08-25 06:49:19', '2025-08-25 06:49:19', '2025-08-25 06:49:19');
