(182, 23, 'EA: I want to trade using RSI(14) divergent. Buy wh...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      RSI_Divergence.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n#property strict\\n\\n\\/\\/ Input parameters\\ninput int RSI_Period = 14;\\ninput double LotSize = 0.01;\\ninput int MagicNumber = 6000;\\n\\n\\/\\/ Global variables\\nint rsiHandle;\\ndouble rsiBuffer[];\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Create RSI indicator handle\\n   rsiHandle = iRSI(_Symbol, _Period, RSI_Period, PRICE_CLOSE);\\n   if (rsiHandle == INVALID_HANDLE)\\n   {\\n      Print(\\\"Failed to create RSI indicator handle.\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   \\/\\/ Set up indicator buffer\\n   ArraySetAsSeries(rsiBuffer, true);\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicator handle\\n   IndicatorRelease(rsiHandle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if there are open positions\\n   if (PositionsTotal() > 0)\\n      return;\\n\\n   \\/\\/ Get RSI values\\n   CopyBuffer(rsiHandle, 0, 0, 3, rsiBuffer);\\n\\n   \\/\\/ Check for buy signal (RSI divergence with morning star or bullish engulfing)\\n   if (IsRSIDivergenceBuy() && (IsMorningStar() || IsBullishEngulfing()))\\n   {\\n      \\/\\/ Open buy position\\n      OpenBuyPosition();\\n   }\\n\\n   \\/\\/ Check for sell signal (RSI divergence with evening star or bearish engulfing)\\n   if (IsRSIDivergenceSell() && (IsEveningStar() || IsBearishEngulfing()))\\n   {\\n      \\/\\/ Open sell position\\n      OpenSellPosition();\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for RSI divergence buy signal                               |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsRSIDivergenceBuy()\\n{\\n   \\/\\/ Implement RSI divergence buy logic here\\n   \\/\\/ Return true if divergence is detected\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for RSI divergence sell signal                              |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsRSIDivergenceSell()\\n{\\n   \\/\\/ Implement RSI divergence sell logic here\\n   \\/\\/ Return true if divergence is detected\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for morning star pattern                                    |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsMorningStar()\\n{\\n   \\/\\/ Implement morning star pattern detection logic here\\n   \\/\\/ Return true if pattern is detected\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for bullish engulfing pattern                              |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsBullishEngulfing()\\n{\\n   \\/\\/ Implement bullish engulfing pattern detection logic here\\n   \\/\\/ Return true if pattern is detected\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for evening star pattern                                    |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsEveningStar()\\n{\\n   \\/\\/ Implement evening star pattern detection logic here\\n   \\/\\/ Return true if pattern is detected\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for bearish engulfing pattern                              |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsBearishEngulfing()\\n{\\n   \\/\\/ Implement bearish engulfing pattern detection logic here\\n   \\/\\/ Return true if pattern is detected\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Open buy position                                                |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenBuyPosition()\\n{\\n   MqlTradeRequest request = {0};\\n   MqlTradeResult result = {0};\\n\\n   request.action = TRADE_ACTION_DEAL;\\n   request.symbol = _Symbol;\\n   request.volume = LotSize;\\n   request.type = ORDER_TYPE_BUY;\\n   request.price = SymbolInfoDouble(_Symbol, SYMBOL_ASK);\\n   request.deviation = 10;\\n   request.magic = MagicNumber;\\n   request.comment = \\\"RSI Divergence Buy\\\";\\n\\n   if (!OrderSend(request, result))\\n   {\\n      Print(\\\"Failed to open buy position. Error: \\\", GetLastError());\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Open sell position                                               |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenSellPosition()\\n{\\n   MqlTradeRequest request = {0};\\n   MqlTradeResult result = {0};\\n\\n   request.action = TRADE_ACTION_DEAL;\\n   request.symbol = _Symbol;\\n   request.volume = LotSize;\\n   request.type = ORDER_TYPE_SELL;\\n   request.price = SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n   request.deviation = 10;\\n   request.magic = MagicNumber;\\n   request.comment = \\\"RSI Divergence Sell\\\";\\n\\n   if (!OrderSend(request, result))\\n   {\\n      Print(\\\"Failed to open sell position. Error: \\\", GetLastError());\\n   }\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"\\u201cI want to trade using RSI(14) divergent. Buy when with morning star or bullish engulfing patterns and sell with evening star or bearish engulfing patterns. Use 0.01 lots size and open trade with magic number 6000\"}', '[]', '2025-08-25 19:24:39', '2025-08-25 19:24:39', '2025-08-25 19:24:39'),
(183, 23, 'EA: Open trade with magic number 6000 using RSI diverg...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      RsiDivergenceEA.mq4 |\\n\\/\\/|                        Copyright 2023, MetaTrader 4 User          |\\n\\/\\/|                                             https:\\/\\/www.mql5.com |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaTrader 4 User\\\"\\n#property link      \\\"https:\\/\\/www.mql5.com\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int      InpRSI_Period = 14;     \\/\\/ RSI Period\\ninput int      InpRSI_Overbought = 70;  \\/\\/ RSI Overbought Level\\ninput int      InpRSI_Oversold = 30;    \\/\\/ RSI Oversold Level\\ninput int      InpMagicNumber = 6000;   \\/\\/ Magic Number\\ninput double   InpLotSize = 0.1;        \\/\\/ Lot Size\\ninput int      InpStopLoss = 100;       \\/\\/ Stop Loss in points\\ninput int      InpTakeProfit = 200;     \\/\\/ Take Profit in points\\n\\n\\/\\/ Global variables\\nint rsiBuffer[];\\nint rsiBufferPrevious[];\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   ArraySetAsSeries(rsiBuffer, true);\\n   ArraySetAsSeries(rsiBufferPrevious, true);\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   ArrayFree(rsiBuffer);\\n   ArrayFree(rsiBufferPrevious);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check for new bar\\n   static datetime lastBarTime = 0;\\n   datetime currentBarTime = iTime(NULL, PERIOD_CURRENT, 0);\\n   if(lastBarTime == currentBarTime)\\n      return;\\n   lastBarTime = currentBarTime;\\n\\n   \\/\\/ Get RSI values\\n   CopyBuffer(iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE, 0), 0, 0, 3, rsiBuffer);\\n   CopyBuffer(iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE, 1), 0, 0, 3, rsiBufferPrevious);\\n\\n   \\/\\/ Check for divergence\\n   bool bullishDivergence = false;\\n   bool bearishDivergence = false;\\n\\n   if(rsiBuffer[0] > rsiBuffer[1] && rsiBuffer[1] < rsiBuffer[2] && rsiBuffer[0] < InpRSI_Overbought && rsiBuffer[2] < InpRSI_Overbought)\\n      bullishDivergence = true;\\n\\n   if(rsiBuffer[0] < rsiBuffer[1] && rsiBuffer[1] > rsiBuffer[2] && rsiBuffer[0] > InpRSI_Oversold && rsiBuffer[2] > InpRSI_Oversold)\\n      bearishDivergence = true;\\n\\n   \\/\\/ Check for reversal pattern\\n   bool reversalPattern = false;\\n   if(iHigh(NULL, PERIOD_CURRENT, 1) < iHigh(NULL, PERIOD_CURRENT, 0) && iLow(NULL, PERIOD_CURRENT, 1) < iLow(NULL, PERIOD_CURRENT, 0))\\n      reversalPattern = true;\\n\\n   \\/\\/ Open trades\\n   if(bullishDivergence && reversalPattern && PositionsTotal() == 0)\\n      OpenBuyOrder();\\n\\n   if(bearishDivergence && reversalPattern && PositionsTotal() == 0)\\n      OpenSellOrder();\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Open buy order                                                   |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenBuyOrder()\\n{\\n   double ask = Ask;\\n   double sl = ask - InpStopLoss * Point;\\n   double tp = ask + InpTakeProfit * Point;\\n\\n   OrderSend(Symbol(), OP_BUY, InpLotSize, ask, 3, sl, tp, \\\"RSI Divergence Buy\\\", InpMagicNumber, 0, clrGreen);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Open sell order                                                  |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenSellOrder()\\n{\\n   double bid = Bid;\\n   double sl = bid + InpStopLoss * Point;\\n   double tp = bid - InpTakeProfit * Point;\\n\\n   OrderSend(Symbol(), OP_SELL, InpLotSize, bid, 3, sl, tp, \\\"RSI Divergence Sell\\\", InpMagicNumber, 0, clrRed);\\n}\\n```\",\"description\":\"Open trade with magic number 6000 using RSI divergent together with reversal chart pattern formation\"}', '[]', '2025-08-25 19:26:39', '2025-08-25 19:26:39', '2025-08-25 19:26:39'),
(184, 23, 'EA: I want to trade using RSI (14) divergent. Buy when...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                      RSIDivergenceEA.mq4         |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n#include <Expert\\\\ExpertAITM_v3_2_5.mqh>\\n\\n\\/\\/ Input parameters\\ninput int      RSI_Period = 14;       \\/\\/ RSI Period\\ninput int      OverSoldLevel = 40;     \\/\\/ OverSold Level\\ninput int      OverBoughtLevel = 60;   \\/\\/ OverBought Level\\ninput bool     UseChartPatterns = true; \\/\\/ Use chart patterns for confirmation\\ninput int      MagicNumber = 123456;   \\/\\/ Magic number for EA identification\\ninput int      LotSize = 0.1;          \\/\\/ Lot size for trades\\n\\n\\/\\/ Global variables\\nCExpertAITM EA_AI;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialize the Expert A.I Trading Master v3.2.5\\n   EA_AI = new CExpertAITM();\\n\\n   if(EA_AI == NULL)\\n   {\\n      Print(\\\"Failed to create Expert A.I Trading Master instance\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Clean up\\n   if(EA_AI != NULL)\\n      delete EA_AI;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   static datetime lastBarTime = 0;\\n   datetime currentBarTime = iTime(NULL, PERIOD_D1, 0);\\n\\n   if(lastBarTime == currentBarTime)\\n      return;\\n\\n   lastBarTime = currentBarTime;\\n\\n   \\/\\/ Calculate RSI\\n   double rsiValue = iRSI(NULL, PERIOD_D1, RSI_Period, PRICE_CLOSE, 0);\\n\\n   \\/\\/ Check for buy signal\\n   if(rsiValue < OverSoldLevel && (UseChartPatterns ? IsBullishReversal() : true))\\n   {\\n      EA_AI.Buy(LotSize, MagicNumber);\\n   }\\n   \\/\\/ Check for sell signal\\n   else if(rsiValue > OverBoughtLevel && (UseChartPatterns ? IsBearishReversal() : true))\\n   {\\n      EA_AI.Sell(LotSize, MagicNumber);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for bullish reversal chart patterns                        |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsBullishReversal()\\n{\\n   \\/\\/ Implement your bullish reversal chart pattern detection logic here\\n   \\/\\/ This is a placeholder function; replace it with actual pattern detection code\\n   return false;\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for bearish reversal chart patterns                       |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsBearishReversal()\\n{\\n   \\/\\/ Implement your bearish reversal chart pattern detection logic here\\n   \\/\\/ This is a placeholder function; replace it with actual pattern detection code\\n   return false;\\n}\\n\\/\\/+-----------------------