== INVALID_HANDLE || RSI_Handle == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error creating indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicators\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check for London\\/NY overlap\\n   if (!IsLondonNYOverlap()) return;\\n\\n   \\/\\/ Check for spread\\n   if (MarketInfo(Symbol(), MODE_SPREAD) > Max_Spread * Point) return;\\n\\n   \\/\\/ Get indicator values\\n   CopyBuffer(EMA_Handle, 0, 0, 3, EMA);\\n   CopyBuffer(SMA_Handle, 0, 0, 3, SMA);\\n   CopyBuffer(RSI_Handle, 0, 0, 3, RSI);\\n\\n   \\/\\/ Check for buy signal\\n   if (EMA[1] <= SMA[1] && EMA[0] > SMA[0] && RSI[0] > 40 && !PositionSelect(Symbol()))\\n   {\\n      double LotSize = CalculateLotSize(Risk_Percentage);\\n      double SL = Bid - StopLoss_Pips * Point;\\n      double TP = Ask + TakeProfit_Pips * Point;\\n      OrderSend(Symbol(), OP_BUY, LotSize, Ask, 3, SL, TP, \\\"Buy Order\\\", 0, 0, clrGreen);\\n   }\\n\\n   \\/\\/ Check for sell signal\\n   if (EMA[1] >= SMA[1] && EMA[0] < SMA[0] && RSI[0] < 60 && !PositionSelect(Symbol()))\\n   {\\n      double LotSize = CalculateLotSize(Risk_Percentage);\\n      double SL = Ask + StopLoss_Pips * Point;\\n      double TP = Bid - TakeProfit_Pips * Point;\\n      OrderSend(Symbol(), OP_SELL, LotSize, Bid, 3, SL, TP, \\\"Sell Order\\\", 0, 0, clrRed);\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                      |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize(double Risk_Percentage)\\n{\\n   double Balance = AccountInfoDouble(ACCOUNT_BALANCE);\\n   double RiskAmount = Balance * Risk_Percentage \\/ 100.0;\\n   double PipValue = MarketInfo(Symbol(), MODE_TICKVALUE) * MarketInfo(Symbol(), MODE_TICK_SIZE);\\n   double LotSize = RiskAmount \\/ (StopLoss_Pips * PipValue);\\n\\n   return(LotSize);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check for London\\/NY overlap                                      |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondonNYOverlap()\\n{\\n   MqlDateTime Time;\\n   TimeCurrent(Time);\\n   int Hour = Time.hour;\\n\\n   return(Hour >= London_NY_Start_Hour && Hour < London_NY_End_Hour);\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\" \\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\"}', '[]', '2025-09-12 11:22:55', '2025-09-12 11:22:55', '2025-09-12 11:22:55'),
