(220, 30, 'EA:  \"I want to trade using 20 EMA and 50 SMA with RSI...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EAStrategy.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpEMA_Period = 20;\\ninput int InpSMA_Period = 50;\\ninput int InpRSI_Period = 14;\\ninput double InpRiskPercent = 2.0;\\ninput int InpStopLoss = 50;\\ninput int InpTakeProfit = 100;\\ninput int InpMaxSpread = 5;\\ninput string InpSessionStart = \\\"08:00\\\";\\ninput string InpSessionEnd = \\\"17:00\\\";\\n\\n\\/\\/ Global variables\\nint EMA_Handle, SMA_Handle, RSI_Handle;\\ndouble EMA[], SMA[], RSI[];\\ndatetime SessionStart, SessionEnd;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Create indicators\\n   EMA_Handle = iMA(NULL, 0, InpEMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   SMA_Handle = iMA(NULL, 0, InpSMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   RSI_Handle = iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE);\\n\\n   if (EMA_Handle == INVALID_HANDLE || SMA_Handle == INVALID_HANDLE || RSI_Handle == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error creating indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   \\/\\/ Set session times\\n   SessionStart = StringToTime(TimeCurrent(), InpSessionStart);\\n   SessionEnd = StringToTime(TimeCurrent(), InpSessionEnd);\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicators\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if we are within the London\\/NY overlap session\\n   datetime currentTime = TimeCurrent();\\n   if (currentTime < SessionStart || currentTime > SessionEnd)\\n      return;\\n\\n   \\/\\/ Check spread\\n   if (Ask - Bid > InpMaxSpread * Point)\\n      return;\\n\\n   \\/\\/ Copy indicator values\\n   CopyBuffer(EMA_Handle, 0, 0, 3, EMA);\\n   CopyBuffer(SMA_Handle, 0, 0, 3, SMA);\\n   CopyBuffer(RSI_Handle, 0, 0, 3, RSI);\\n\\n   \\/\\/ Check for buy signal\\n   if (EMA[1] <= SMA[1] && EMA[0] > SMA[0] && RSI[0] > 40)\\n   {\\n      double lotSize = CalculateLotSize();\\n      if (lotSize > 0)\\n      {\\n         OrderSend(Symbol(), OP_BUY, lotSize, Ask, 3, 0, 0, \\\"Buy Order\\\", 0, 0, clrGreen);\\n      }\\n   }\\n   \\/\\/ Check for sell signal\\n   else if (EMA[1] >= SMA[1] && EMA[0] < SMA[0] && RSI[0] < 60)\\n   {\\n      double lotSize = CalculateLotSize();\\n      if (lotSize > 0)\\n      {\\n         OrderSend(Symbol(), OP_SELL, lotSize, Bid, 3, 0, 0, \\\"Sell Order\\\", 0, 0, clrRed);\\n      }\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                       |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize()\\n{\\n   double balance = AccountInfoDouble(ACCOUNT_BALANCE);\\n   double riskAmount = balance * InpRiskPercent \\/ 100.0;\\n   double pipValue = MarketInfo(Symbol(), MODE_TICKVALUE) \\/ MarketInfo(Symbol(), MODE_POINT);\\n   double lotSize = riskAmount \\/ (InpStopLoss * pipValue);\\n\\n   return(NormalizeDouble(lotSize, _Digits));\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\" \\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\"}', '[]', '2025-09-12 11:27:34', '2025-09-12 11:27:34', '2025-09-12 11:27:34'),
