(249, 17, 'EA: I want to trade using 20 EMA and 50 SMA with RSI(1...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EMARSIEA.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n\\/\\/ Input parameters\\ninput int InpEMA_Period = 20;\\ninput int InpSMA_Period = 50;\\ninput int InpRSI_Period = 14;\\ninput double InpRiskPercent = 2.0;\\ninput int InpStopLossPips = 50;\\ninput int InpTakeProfitPips = 100;\\ninput int InpMaxSpread = 5;\\ninput datetime InpStartHour = D\'2023.01.01 08:00\'; \\/\\/ London\\/NY overlap start (8 AM GMT)\\ninput datetime InpEndHour = D\'2023.01.01 16:00\';   \\/\\/ London\\/NY overlap end (4 PM GMT)\\n\\n\\/\\/ Global variables\\nint handleEMA, handleSMA, handleRSI;\\ndouble EMA[], SMA[], RSI[];\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Initialize indicators\\n   handleEMA = iMA(NULL, 0, InpEMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   handleSMA = iMA(NULL, 0, InpSMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   handleRSI = iRSI(NULL, 0, InpRSI_Period, PRICE_CLOSE);\\n\\n   \\/\\/ Check if indicators were created successfully\\n   if (handleEMA == INVALID_HANDLE || handleSMA == INVALID_HANDLE || handleRSI == INVALID_HANDLE)\\n   {\\n      Print(\\\"Error: Failed to create indicators\\\");\\n      return(INIT_FAILED);\\n   }\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicators\\n   IndicatorRelease(handleEMA);\\n   IndicatorRelease(handleSMA);\\n   IndicatorRelease(handleRSI);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if in London\\/NY overlap and spread is acceptable\\n   if (!IsLondonNYOverlap() || SymbolInfoDouble(_Symbol, SYMBOL_ASK) - SymbolInfoDouble(_Symbol, SYMBOL_BID) > InpMaxSpread * Point)\\n   {\\n      return;\\n   }\\n\\n   \\/\\/ Get indicator values\\n   if (CopyBuffer(handleEMA, 0, 0, 3, EMA) <= 0 || CopyBuffer(handleSMA, 0, 0, 3, SMA) <= 0 || CopyBuffer(handleRSI, 0, 0, 3, RSI) <= 0)\\n   {\\n      Print(\\\"Error: Failed to copy indicator values\\\");\\n      return;\\n   }\\n\\n   \\/\\/ Check for buy signal\\n   if (EMA[1] <= SMA[1] && EMA[0] > SMA[0] && RSI[0] > 40 && PositionSelect(_Symbol) == false)\\n   {\\n      double lotSize = CalculateLotSize();\\n      if (lotSize > 0)\\n      {\\n         OpenOrder(OP_BUY, lotSize);\\n      }\\n   }\\n\\n   \\/\\/ Check for sell signal\\n   if (EMA[1] >= SMA[1] && EMA[0] < SMA[0] && RSI[0] < 60 && PositionSelect(_Symbol) == false)\\n   {\\n      double lotSize = CalculateLotSize();\\n      if (lotSize > 0)\\n      {\\n         OpenOrder(OP_SELL, lotSize);\\n      }\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check if in London\\/NY overlap                                     |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondonNYOverlap()\\n{\\n   datetime currentTime = TimeCurrent();\\n   datetime startTime = StringToTime(TimeToString(InpStartHour, TIME_DATE | TIME_MINUTES));\\n   datetime endTime = StringToTime(TimeToString(InpEndHour, TIME_DATE | TIME_MINUTES));\\n\\n   return (currentTime >= startTime && currentTime <= endTime);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Calculate lot size based on risk percentage                        |\\n\\/\\/+------------------------------------------------------------------+\\ndouble CalculateLotSize()\\n{\\n   double accountBalance = AccountInfoDouble(ACCOUNT_BALANCE);\\n   double riskAmount = accountBalance * InpRiskPercent \\/ 100.0;\\n   double pipValue = SymbolInfoDouble(_Symbol, SYMBOL_TRADE_TICK_VALUE) * SymbolInfoInteger(_Symbol, SYMBOL_TRADE_TICK_SIZE);\\n   double lotSize = riskAmount \\/ (InpStopLossPips * pipValue);\\n\\n   return (lotSize);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Open order                                                         |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OpenOrder(int cmd, double lotSize)\\n{\\n   double sl = 0, tp = 0;\\n   double ask = SymbolInfoDouble(_Symbol, SYMBOL_ASK);\\n   double bid = SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n\\n   if (cmd == OP_BUY)\\n   {\\n      sl = ask - InpStopLossPips * Point;\\n      tp = ask + InpTakeProfitPips * Point;\\n   }\\n   else if (cmd == OP_SELL)\\n   {\\n      sl = bid + InpStopLossPips * Point;\\n      tp = bid - InpTakeProfitPips * Point;\\n   }\\n\\n   int ticket = OrderSend(_Symbol, cmd, lotSize, ask, 3, sl, tp, \\\"EMA RSI EA\\\", 0, 0, clrNONE);\\n   if (ticket < 0)\\n   {\\n      Print(\\\"Error opening order: \\\", GetLastError());\\n   }\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\"}', '[]', '2025-09-22 07:49:49', '2025-09-22 07:49:49', '2025-09-22 07:49:49'),
