(252, 15, 'EA: \"I want to trade using 20 EMA and 50 SMA with RSI(...', 'ea_generation', 'mistralai/mistral-small-3.2-24b-instruct:free', '{\"code\":\"```mql4\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/|                                                      EMARSIBOT.mq4 |\\n\\/\\/|                        Copyright 2023, MetaQuotes Software Corp. |\\n\\/\\/|                                             https:\\/\\/www.metaquotes.net\\/ |\\n\\/\\/+------------------------------------------------------------------+\\n#property copyright \\\"Copyright 2023, MetaQuotes Software Corp.\\\"\\n#property link      \\\"https:\\/\\/www.metaquotes.net\\/\\\"\\n#property version   \\\"1.00\\\"\\n\\n#include <Trade\\\\Trade.mqh>\\nCTrade trade;\\n\\n\\/\\/ Input parameters\\nextern double LotSize = 0.1;\\nextern int    EMA_Period = 20;\\nextern int    SMA_Period = 50;\\nextern int    RSI_Period = 14;\\nextern double RiskPercent = 2.0;\\nextern int    StopLoss = 50;\\nextern int    TakeProfit = 100;\\nextern double MaxSpread = 5.0;\\n\\n\\/\\/ Global variables\\nint EMA_Handle, SMA_Handle, RSI_Handle;\\ndatetime LondonOpen, NYOpen, LondonClose, NYClose;\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert initialization function                                   |\\n\\/\\/+------------------------------------------------------------------+\\nint OnInit()\\n{\\n   \\/\\/ Create indicators\\n   EMA_Handle = iMA(NULL, 0, EMA_Period, 0, MODE_EMA, PRICE_CLOSE);\\n   SMA_Handle = iMA(NULL, 0, SMA_Period, 0, MODE_SMA, PRICE_CLOSE);\\n   RSI_Handle = iRSI(NULL, 0, RSI_Period, PRICE_CLOSE);\\n\\n   \\/\\/ Set time for London\\/NY overlap (UTC+0)\\n   LondonOpen = StringToTime(\\\"08:00\\\");\\n   NYOpen = StringToTime(\\\"13:00\\\");\\n   LondonClose = StringToTime(\\\"17:00\\\");\\n   NYClose = StringToTime(\\\"22:00\\\");\\n\\n   return(INIT_SUCCEEDED);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert deinitialization function                                 |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnDeinit(const int reason)\\n{\\n   \\/\\/ Release indicators\\n   IndicatorRelease(EMA_Handle);\\n   IndicatorRelease(SMA_Handle);\\n   IndicatorRelease(RSI_Handle);\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Expert tick function                                             |\\n\\/\\/+------------------------------------------------------------------+\\nvoid OnTick()\\n{\\n   \\/\\/ Check if we are in London\\/NY overlap and spread is acceptable\\n   if (!IsLondonNYOverlap() || SymbolInfoDouble(_Symbol, SYMBOL_ASK) - SymbolInfoDouble(_Symbol, SYMBOL_BID) > MaxSpread * Point)\\n      return;\\n\\n   \\/\\/ Get indicator values\\n   double EMA_Buffer[], SMA_Buffer[], RSI_Buffer[];\\n   CopyBuffer(EMA_Handle, 0, 0, 3, EMA_Buffer);\\n   CopyBuffer(SMA_Handle, 0, 0, 3, SMA_Buffer);\\n   CopyBuffer(RSI_Handle, 0, 0, 1, RSI_Buffer);\\n\\n   \\/\\/ Check for buy signal\\n   if (EMA_Buffer[1] <= SMA_Buffer[1] && EMA_Buffer[0] > SMA_Buffer[0] && RSI_Buffer[0] > 40)\\n   {\\n      double entryPrice = SymbolInfoDouble(_Symbol, SYMBOL_ASK);\\n      double stopLoss = entryPrice - StopLoss * Point;\\n      double takeProfit = entryPrice + TakeProfit * Point;\\n\\n      trade.Buy(LotSize, _Symbol, entryPrice, stopLoss, takeProfit, \\\"Buy Order\\\");\\n   }\\n\\n   \\/\\/ Check for sell signal\\n   else if (EMA_Buffer[1] >= SMA_Buffer[1] && EMA_Buffer[0] < SMA_Buffer[0] && RSI_Buffer[0] < 60)\\n   {\\n      double entryPrice = SymbolInfoDouble(_Symbol, SYMBOL_BID);\\n      double stopLoss = entryPrice + StopLoss * Point;\\n      double takeProfit = entryPrice - TakeProfit * Point;\\n\\n      trade.Sell(LotSize, _Symbol, entryPrice, stopLoss, takeProfit, \\\"Sell Order\\\");\\n   }\\n}\\n\\n\\/\\/+------------------------------------------------------------------+\\n\\/\\/| Check if current time is within London\\/NY overlap                 |\\n\\/\\/+------------------------------------------------------------------+\\nbool IsLondonNYOverlap()\\n{\\n   datetime currentTime = TimeCurrent();\\n   return (currentTime >= LondonOpen && currentTime <= NYClose);\\n}\\n\\/\\/+------------------------------------------------------------------+\\n```\",\"description\":\"\\\"I want to trade using 20 EMA and 50 SMA with RSI(14). Buy when EMA crosses above SMA and RSI > 40. Sell when EMA crosses below SMA and RSI < 60. Use 2% risk per trade, 50 pip SL, 100 pip TP. Only trade during London\\/NY overlap with max 5 pip spread.\\\"\"}', '[]', '2025-09-23 08:25:27', '2025-09-23 08:25:27', '2025-09-23 08:25:27'),
